3,'Un proyecto realizado con exito, aunque sea realizado en píjama, sigue siendo un exito, una venta realizada desde la sala de la casa, sigue siendo una venta... no?','2019-08-22 18:13:28','2019-08-22 18:13:28'),(42,49,0,106,'Me han dado la oportunidad de hacerlo, y la experiencia fue excelente. El cambiar de ambiente de vez en cuando, activa el chip, la creatividad mejora y sobretodo la motivación crece.','2019-08-23 08:57:37','2019-08-23 08:57:37'),(43,63,0,92,'Debido a que solo se puede hacer con siemens, y dependiendo de mas factores, yo diría que  deberia funcionar de varias formas:\ncrear una forma fácil de descripción de la subestación, y a partir de esa descripción se genere toda la IHM','2019-08-26 17:30:43','2019-08-26 17:30:43'),(44,88,0,76,'test','2019-08-26 17:31:47','2019-08-26 17:31:47'),(45,63,0,92,'Debido a que actualmente solo se puede hacer con Siemens, y dependiendo de mas factores, yo diría que debería funcionar de varias formas: \n1. Crear una forma fácil de descripción de la subestación, y a partir de esa descripción se genere toda la IHM.\n2. Generación a partir de las configuraciones de los diferentes fabricantes a medida que cada uno vaya integrando esa opción.','2019-08-26 17:35:23','2019-08-26 17:35:23'),(46,63,0,121,'Seria excelente contar con un prototipo y observar cuales son los parametros que busca agilizar esta solucion, determinando cuales son los cuellos de botella frente a los tiempos criticos y como esta contribucion apoyaria sobre esta tematica','2019-08-27 08:33:47','2019-08-27 08:33:47'),(47,55,0,112,'Es vender experiencia','2019-08-28 08:13:43','2019-08-28 08:13:43'),(48,47,0,112,'unirlo con vender experiencia, que los clientes vengan también a divertirse con todo el equipos de Axon, no solo vendedores, iniciarlo con las capacitaciones dictadas en nuestras instalaciones! 2 pájaros de un solo tiro. Y quien sabe, que tal al futuro hasta se inventen reuniones solo por venir acá. El trabajo de ventas hoy en días es buscar espacios para compartir con el cliente, para crear conexión - vinculo.','2019-08-28 08:24:53','2019-08-28 08:24:53'),(49,63,0,112,'La idea es de hace mucho tiempo y en ese momento ayudaba en contrarrestar los pensamientos de los prospectos de la robustez del software, es decir al tener el software una característica como esta, que impacta y sorprende, vendiéndolo de esa forma, el prospecto no iba a preguntar por la robustez (en ese entonces no había muchos sistemas instalados). Es por esto que si preguntamos a clientes, serán los integradores los que si le vean mayor beneficio.  Una de las estrategias de algunas compañías es tener un producto super wow! con perdida, solo para vender el resto de productos, por ejemplo: los carros super lujosos que fabrica chevrolet, esos de alta gama, chevrolet pierde, su diseño y producción son muy caros, no consiguen ganancia con los que venden, pero ese carro les sirve para vender el resto de productos, otro ejemplo: cafeterías en estados unidos donde venden el cafe del Civeta, el animalito que defeca el café, que la taza puede costar 100 usd, no lo venden, solo lo ponen para vender el resto. Aunque en proporción los clientes tengan otras necesidades mas urgente y pueda que no vean mucho el beneficio para decidir por el nuestro, esta característica sería para seguir el concepto del chevrolet.','2019-08-28 08:42:20','2019-08-28 08:42:20'),(50,104,0,113,'-Descarga de comtrades se hace con un software de Axon llamado Axon Comtrade. No está evaluado aún que tan funcional es percibido por un cliente como para hacer parte del scada.','2019-08-28 11:50:35','2019-08-28 11:50:35'),(51,104,0,113,'-Advertir de una carga mas alta de lo normal debería poderse configurar como una notificación de los registros históricos. No sé hasta que punto sea un dato interesando en la operación de la subestación, depronto en un centro de control si.','2019-08-28 11:52:47','2019-08-28 11:52:47'),(52,104,0,113,'-Alarmar previo a que se estén alcanzando los ajustes de las protecciones no tendría mucha utilizad porque la mayoría de fallas ocurren en ms. EL sistema de protecciones despeja la falla mucho antes de que la personas leyera una notificación.','2019-08-28 11:54:56','2019-08-28 11:54:56'),(53,104,0,113,'-La energización automatiza de una línea dependería del análisis de los estados de flujo de potencia en el sistema y de otros parámetros que no dependen de la subestación solamente. Realizar análisis de flujos de carga es muy complejo matemáticamente hablando y a nivel de desarrollo supongo que es aún mayor. La decisión de abrir o cerrar una línea muchas veces depende de como se realiza el despacho de energía desde el centro nacional de despacho, no puede ser una decisión de un software.','2019-08-28 12:01:15','2019-08-28 12:01:15'),(54,104,0,113,'-A pesar de que un scada tiene posibilidad de tener logicas programadas, no tiene la capacidad de procesamiento ni la velocidad para realizar funciones de protección. EL arranque de generadores es complejo y requiere de protecciones.','2019-08-28 12:03:17','2019-08-28 12:03:17'),(55,104,0,113,'-La idea de una app que envíe notificaciones con alarmas o eventos recientes me parece buena.','2019-08-28 12:03:49','2019-08-28 12:03:49'),(56,104,0,113,'-Lo del estandar para mapear senales me parece bueno, sin embargo tener en cuenta que la integración de la bahía sea hace en dias o un par de semanas, el sistema seguirá operando por anios entonces es una funcionalidad que solamente es atractiva para quien realiza la integración, no para quien estará utilizando el software.','2019-08-28 12:05:10','2019-08-28 12:05:10'),(57,99,0,113,'Como software de aprendizaje y/o simulación me parece muy chevere, pero como funcionalidad para la operación del scada no me parece ya que en las subestaciones o centros de control los operarios no se la pasan haciendo simulaciones, una simulación se haría solamente en casos puntuales y de manera muy eventual\n.','2019-08-28 12:07:56','2019-08-28 12:07:56'),(58,98,0,113,'Me gusta la idea, me parece muy util para el diagnostico de fallas de red.','2019-08-28 12:08:42','2019-08-28 12:08:42'),(59,96,0,113,'Me parece una idea muy buena pero falta desarrollarla más. La información de disparo llega al centro de control. lo de energía se supervisa con el software de gestión de medida.','2019-08-28 12:15:34','2019-08-28 12:15:34'),(60,95,0,113,'Si, de hecho podria tener integración con el BMS.','2019-08-28 12:16:35','2019-08-28 12:16:35'),(61,89,0,113,'Suena chevere, organizando las alarmas es mas facil notificar a un operador mediante una APP por ejemplo.','2019-08-28 12:18:56','2019-08-28 12:18:56'),(62,63,0,113,'Independientemente de que tan viable o posible sea lograr esto (y el costo de desarrollarlo), es una funcionalidad que solamente le sirve a quien configura e integra el sistema, a partir de que inicie a operar esta funcionalidad no tiene ningún valor para el operador ni para la empresa.','2019-08-28 12:25:54','2019-08-28 12:25:54'),(63,63,0,113,'Sería una funcionalidad \"wow\" para poner en un catalogo pero inutil en la practica. Aclaro que inutil para el cliente final, recuerden que el producto es para el cliente, no para el personal de Axon que lo configura. Si eventualmente esto se pudiera lograr como optimización de procesos y de horas hombre dentro de la empresa sería chevere, pero como funcionalidad para el scada no.','2019-08-28 12:27:26','2019-08-28 12:27:26'),(64,60,0,113,'Por que quedan anonimas? sería chevere poder saber quienes estan escribiendo.','2019-08-28 12:48:40','2019-08-28 12:48:40'),(65,43,0,113,'Me parece que es mas importante eliminar \"junior y senior\" y \"auxiliar y asistente\" de los cargos. Los nombres de los cargos y las áreas no tienen que ser en ingles mucho menos si se atienden clientes que no hablan ingles, eso no tiene ningún sentido a menos que se atiendan clientes que no hablen espaniol.','2019-08-28 13:02:53','2019-08-28 13:02:53'),(66,66,0,113,'Creo que el titulo no es claro pero la descripción esta chevere. me gusta.','2019-08-28 13:07:20','2019-08-28 13:07:20'),(67,49,0,113,'De acuerdo muchas empresas ya lo hacen (desde hace mucho), pretender que un trabajador permanezca todo el tiempo sentado no tiene sentido y es un pensamiento anticuado, lo importante es la productividad, no las horas calentando puesto.','2019-08-28 13:10:08','2019-08-28 13:10:08'),(68,52,0,113,'El área de pruebas de Axon no es como para mostrarsela a un cliente, si ven como somos en casa pensaran que asi mismo serán los proyectos y lo que pasa es que en casa de herrero cuchillo de palo. Se necesitan instalaciones electricas seguras y apropiadas, racks para montaje de los equipos, espacio para ubicación de equipos provisionales, espacios de trabajo provisionales.','2019-08-28 13:13:02','2019-08-28 13:13:02'),(69,55,0,113,'Chevere la idea, creo que es una acción de mejora para las capacitaciones.','2019-08-28 13:14:00','2019-08-28 13:14:00'),(70,87,0,113,'Creo que es para mejorar la interacción entre axon-axon y axon-clientes. Podría ser tipo cronograma donde se asignan fechas y responsables y se relacionan los entregables.','2019-08-28 13:43:04','2019-08-28 13:43:04'),(71,67,0,113,'Chevere me gusta esta idea.','2019-08-28 13:44:46','2019-08-28 13:44:46'),(72,0,71,113,'Creo que puede tener resultados muy buenos al mediano plazo y no requiere una inversión muy grande.','2019-08-28 13:45:19','2019-08-28 13:45:19'),(73,106,0,93,'Nosotros mismos entramos a volver al IHM Local un antagonista y asi entramos mandando la parada con un SCADA desde un dispositivo que tiene todo el mundo. Me gusta!!!','2019-08-28 15:36:57','2019-08-28 15:36:57'),(74,105,0,93,'Me gusta la idea sobre todo por que vamos plantearnos \"imposibles posibles\", podemos plantear linea de ideas de \"escribir nuestra ciencia ficción\", que pongan a la gente a pensar en cosas de \"ciencia ficción\" y que proponga desde ya con qué nos vamos a encontrar en el futuro e ir desarrollando en esa dirección.','2019-08-28 17:38:20','2019-08-28 17:38:20'),(75,107,0,93,'Management 3.0. https://management30.com','2019-08-28 17:41:33','2019-08-28 17:41:33'),(76,107,0,76,'Me gusta esa idea','2019-08-28 19:43:56','2019-08-28 19:43:56'),(77,107,0,76,'Me gusta esa idea','2019-08-28 19:43:56','2019-08-28 19:43:56'),(78,105,0,93,'¿Cuál es el \"problema de mañana\" en el cual deberíamos comenzar ahora mismo?','2019-08-28 21:59:09','2019-08-28 21:59:09'),(79,104,0,93,'¿Podría esta idea estar en linea con la de generación automática de SCADA apartir de archivosarchivo de IEC61850? ¿Los comtrades seria integreran dos herramientas con as que cuenta AXON\n?','2019-08-28 22:04:04','2019-08-28 22:04:04'),(80,96,0,93,'¿Podria esta idea unirse con la de SCADA en la mano? Seria un unica solución, y la empresa que la adquiere selecciona los.modulos a adquirir, es decir si soy de proteccion o soy de mantenimiento o soy administrador. Se podria adquirir servicios por modulos (tipos de, usuarios), por número de usuarios, por número de subestaciones. Crear planes mensuales diseñandos en tres modelos.','2019-08-28 22:12:46','2019-08-28 22:12:46'),(81,58,0,93,'¿cómo sería en español? Has pensado en la mejor descripción?','2019-08-29 09:00:36','2019-08-29 09:00:36'),(82,0,81,93,'No en la traducción o significado de las palabras sino en el nombre que va del otro lado dela tarjeta','2019-08-29 09:01:15','2019-08-29 09:01:15'),(83,87,0,93,'¿es una herramienta de gestión de proyectos? o ¿podría estar en linea con una herramienta que reuna muchas actividades dentro de un proyecto, con notificaciones relacionadas con el mismo?','2019-08-29 09:08:32','2019-08-29 09:08:32'),(84,107,0,86,'Muy buena idea.','2019-08-29 15:51:43','2019-08-29 15:51:43'),(85,0,50,101,'precisamente lo que se esta pidiendo en el reto es las características que debe tener el nuevo SCADA, osea implica realizar o mejorar.  si producto de esta idea se debe agrupar software, pues seria el resultado del reto','2019-08-29 16:14:18','2019-08-29 16:14:18'),(86,109,0,101,'me parece interesante la parte de eficiencia energética de un sistema. pero pensaría que eso es un desarrollo bastante grande, solo para una característica adicional.','2019-08-29 16:20:14','2019-08-29 16:20:14'),(87,108,0,101,'interesante aunque normalmente el operador del SCADA no es la misma persona que analiza fallas. entonces cono lo veo yo, para el operador seria información sin importancia desplegada en la pantalla','2019-08-29 16:32:14','2019-08-29 16:32:14'),(88,87,0,101,'como complemento, existe ya una app \"de la competencia\" que permite hacer seguimiento con cronograma a las actividades a través de una app y me parece interesante esta idea, ademas permite realizar solicitud de anticipos y legalizaciones,  lo que me parece supremamente practico','2019-08-29 16:38:02','2019-08-29 16:38:02'),(89,0,52,101,'una cosa puede ser un alarma previa a una proteccion por ejemplo  por una sobrecarga y otra un Arranque de funcion (que es un disparo en proceso).  como alarma por sobrecarga se pueden tomar acciones (por ejemplo una sencilla es no meter mas carga) , como pickup no, frente a un arranque nadie hace nada, normalmente por que no se dan cuenta hasta el disparo. y porque asi se dieran cuenta no pueden ya hacer nada.','2019-08-29 16:43:08','2019-08-29 16:43:08'),(90,0,53,101,'si se dispara la linea de entrada de una Sub. el paso a seguir es abrir (sino lo hace solo) todas la cargas y con previa autorización empezar a cerrar carga una por una. en esos casos yo puedo darle cerrar automáticamente, de hecho se me ocurre como complemento de la idea original que verifique la carga previa al disparo y de esa manera sepa que tanta carga puede conectar. no se requieren analisis de cargas para este tipo de maniobra, solo autorización','2019-08-29 16:46:47','2019-08-29 16:46:47'),(91,0,54,101,'como lo veo yo, no supondría un reemplazo a las protecciones, la energizacion de un generador son una serie de acciones de control, que se deben realizar en secuencia y que no implican alterar esquemas de protección. es algo asi como cuando \"X\" variable llegue a tal valor pase al siguiente paso, ese es el tipo de logicas que debe realizar un operador de central generadora. y eso se puede realizar casi que con un script pero pues el marketing que tendria la idea de inteligencia artificial me parece mejor a decir SCADA con la posibilidad de script','2019-08-29 16:52:11','2019-08-29 16:52:11'),(92,0,79,101,'ayer vi la idea de la generacion automatica de SCADA y me parece muy interesante, pero pues esta enfocada en facilitar la ejecución del proyecto. para el cliente no tendría nada nuevo el scada excepto que se entrego mas rápido. como yo lo veo.  creo que existe ya otra solucion que propone esa integracion. y le veo de inconveniente si es util para el operador tener informacion de analisis de fallas, puesto que es mas tema de un ing de protecciones no de un operador','2019-08-29 16:57:05','2019-08-29 16:57:05'),(93,0,51,101,'para SCADAs de distribución es importante los comportamientos de las cargas frente a sus históricos. entonces mas que si es importante (yo tampoco le veo importancia) el tema es que se hace y se puede aprovechar el hecho de que se necesita en algunos casos','2019-08-29 16:59:23','2019-08-29 16:59:23'),(94,105,0,101,'no creo que las protecciones desaparezcan, finalmente mientras existan transformadores, lineas y generadores se va a necesitar protegerlos. y los reles posiblemente van a evolucionar a las tablets. ya que los fabricantes de reles tienen el desarrollo fuerte de software ya, es mas facil adaptarlo a una pantalla, a que los fabricantes de tablets ingresen al mercado de subestaciones por ejemplo, entonces de cierta forma no desaparecen, sino evolucionan como el celular de teclas al tactil. por otro lado yo apostaría por la inteligencia distribuida. y no unificada. siempre ah generado mejores resultados en la industria y la tendencia siempre ah sido por este camino por que representa beneficios y si mal no estoy es parte de lo que busca una red neuronal, comparto la idea de que se van a quitar los cableados de cobre, se disminuirán los cuartos de control de las subestaciones y el tema de cyberseguridad tendrá mas importancia aun. pero creo que seguirá funcionando bajo un esquema distribuido donde tablets manejaran bahías no subestaciones. es mi punto de vista.','2019-08-29 17:32:56','2019-08-29 17:32:56'),(95,99,0,101,'comparto la anterior opinión. ya que no creo que en un SCADA ya funcional exista interés para utilizarlo como simulador y hacer pruebas. creo que lo primero que generaría seria miedo de causar daños o mandos indeseados. sin embargo tendria utilidad durante la puesta en servicio o pruebas FAT y SAT. en ese caso si seria bastante util poder realizar pruebas de enclavamientos  de forma automatica o pruebas de mandos en las FAT por ejemplo','2019-08-29 17:37:54','2019-08-29 17:37:54'),(96,0,87,94,'Si, cierto para el operador no sería de mucho utilidad, pero para los ingenieros que recopilan los datos en el SCADA o para un centro de control penseria que sería bastante útil.','2019-08-29 22:04:57','2019-08-29 22:04:57'),(97,106,0,94,'Me gusta y es importante tener en cuenta en el momento de la implementación que la app cumpla con características de cyberseguridad, ya que a pesar de que solo va a supervisar puede que sea vuelva un puente que sea capaz de vulnerar un sistema. Pero es un aspecto que se puede trabajar.','2019-08-29 22:09:43','2019-08-29 22:09:43'),(98,0,50,94,'Comparto la opinión','2019-08-29 22:11:22','2019-08-29 22:11:22'),(99,96,0,94,'La idea es buena, pero antes considera evaluar con lo que se hace actualmente, ya que la información se almacena en una base de datos, la cual si es bien gestionada y configurada, las personas interesadas pueden tener acceso a la información desde un almacenamiento local por el cual no pagan una mensualidad.','2019-08-29 22:22:49','2019-08-29 22:22:49'),(100,94,0,94,'Me gusta! Que el SCADA tenga 