INSERT INTO `innovations` VALUES (1,'Restaurante especializado en comida de mar','Los pueblos pequeños generalmente carecen de buenos restaurantes, esto causa que muchas personas solo puedan disfrutar de platos realmente deliciosos fuera de lo normal, cuando van a otros lugares más poblados.','<div class=\"alert alert-light alert-elevate\" role=\"alert\">\n								\n								<div class=\"alert-text\"><div class=\"node-image field field--name-field-main-picture field--type-image field--label-hidden\" itemprop=\"image\" style=\"box-sizing: border-box; margin-top: 10px; margin-bottom: 20px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Merriweather, serif; vertical-align: baseline; color: rgb(0, 0, 0);\"><div class=\"ds-1col file file-image file-image-jpeg view-mode-article clearfix\" style=\"box-sizing: border-box; margin-bottom: 20px; border: 0px; font: inherit; vertical-align: baseline; overflow: hidden;\"><img src=\"https://www.elespectador.com/sites/default/files/parmesan_cheese_wheel.jpg\" width=\"984\" height=\"655\" alt=\"\" style=\"box-sizing: border-box; display: block; border: 0px; font: inherit; vertical-align: baseline; height: auto; width: 650px;\"><div class=\"group-caption field-group-div caption\" style=\"box-sizing: border-box; padding: 10px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: 0.875rem; line-height: 1.3rem; font-family: inherit; vertical-align: baseline; background: rgb(29, 29, 29); color: rgb(255, 255, 255);\"><span class=\"description\" style=\"box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: 14px; line-height: inherit; font-family: inherit; vertical-align: baseline;\">La naviera Oceania Cruise Lines es reconocida en el portal especializado Cruise Critics por tener la mejor gastronomía en alta mar. / Cortesía</span></div></div></div><div class=\"node-body content_nota field field--name-body field--type-text-with-summary field--label-hidden\" style=\"box-sizing: border-box; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Merriweather, serif; vertical-align: baseline; color: rgb(0, 0, 0);\"><p style=\"box-sizing: border-box; margin-bottom: 15px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: 30px; font-family: inherit; vertical-align: baseline;\">Cocinar no es fácil y menos si se hace para cientos de personas a bordo de un crucero en busca de tranquilidad y diversión. Los estómagos delicados y los paladares selectivos no son pocos. A esto se suman los mareos que a veces son inevitables en alta mar y el norovirus, una enfermedad que preocupa a autoridades como el Programa para la Higiene de los Barcos, de Estados Unidos, que chequea los navíos dos veces al año para asegurarse de que estén fuera de peligro.</p><p style=\"box-sizing: border-box; margin-bottom: 15px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: 30px; font-family: inherit; vertical-align: baseline;\">Este malestar, que no es mortal, pero sí muy incómodo y contagioso, puede causar cuadros de gastroenteritis caracterizados por náuseas, diarrea y dolor abdominal. Por eso, y porque uno de los alimentos a los que más se asocia son los mariscos, es que los cruceros deben tener mucho cuidado con la comida que sirven, explican desde la Asociación Internacional de Líneas de Cruceros.</p><p style=\"box-sizing: border-box; margin-bottom: 15px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: 30px; font-family: inherit; vertical-align: baseline;\">En este sentido, la naviera que mejor hace la tarea es Oceania Cruise Lines que, de acuerdo con el portal especializado Cruise Critics, ofrece la mejor comida de los siete mares. Pero, ¿qué ha hecho para ganarse este título?</p><p style=\"box-sizing: border-box; margin-bottom: 15px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: 30px; font-family: inherit; vertical-align: baseline;\">Cada uno de sus seis navíos –Regatta, Insignia, Náutica, Sirena, Marina y Rivera– tiene seis restaurantes, con los que garantiza variedad para todos los gustos. Exquisitos platos de cocina francesa, italiana, fusión asiática y hasta un steak house se encuentran entre sus especialidades.</p><p style=\"box-sizing: border-box; margin-bottom: 15px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: 30px; font-family: inherit; vertical-align: baseline;\">Pero más que los platos, lo importante son los ingredientes, que se compran frescos en los mercados de los puertos en los que atraca durante cada recorrido. Éstos son almacenados en cocinas de primera categoría y no sólo se usan en los platillos de cada restaurante, sino también en los Culinary Discovery Tours, que les dan la oportunidad a los pasajeros de experimentar la cocina autóctona de cada lugar. “Queremos que en nuestros platos se sienta el sabor propio de cada sitio al que llegamos”, explica Karem Nova, directora para Colombia de Oceania Cruises.</p><p style=\"box-sizing: border-box; margin-bottom: 15px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: 30px; font-family: inherit; vertical-align: baseline;\">El viaje a bordo, entonces, no sólo es saludable sino variado, pues rara vez se repiten las comidas. Esta experiencia se refuerza con excursiones en tierra, otro escenario en donde el buen comer y beber prevalecen: los pasajeros visitan mercados locales, granjas, viñedos y algunos de los más populares y exquisitos restaurantes.</p><p style=\"box-sizing: border-box; margin-bottom: 15px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: 30px; font-family: inherit; vertical-align: baseline;\">El aspecto gastronómico es tan importante para esta línea, que no tienen problema con demostrarles la pulcritud de sus procesos a los pasajeros. Para ello cuentan con la primera escuela de cocina en alta mar, donde se enseña a preparar algunos de los platillos que se sirven durante la travesía. Lo hacen en cocinetas completamente equipadas, que en realidad son una versión miniatura de las cocinas del barco.</p><p style=\"box-sizing: border-box; margin-bottom: 15px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: 30px; font-family: inherit; vertical-align: baseline;\">La mente maestra detrás de la estrategia gastronómica de Oceania Cruises Lines es el reconocido chef francés Jaques Pépin. Su misión es asegurarse de que los platillos, sus procesos e ingredientes son los idóneos para ofrecer una experiencia tan deliciosa como saludable en cruceros como el Marina y el Riviera, con capacidad para más de mil personas cada uno.</p></div></div>\n							</div>','http://revistaelconocedor.com/wp-content/uploads/2016/01/123.jpg','food',NULL,'en',NULL,'showme','public','no',0,1,NULL,NULL,NULL,0,'2019-05-31 00:24:43','2019-07-25 04:24:46'),(2,'Idea creada por Yeison','\'Awesome idea description...\'','<p>cuerpo by ye</p>','https://images.unsplash.com/photo-1493612276216-ee3925520721?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=700&q=80','sportsandentertainment',NULL,'en',NULL,'showme','me','no',0,17,NULL,NULL,NULL,0,'2019-05-31 00:30:34','2019-05-31 00:30:34'),(3,'Vamos a arreglar el dropdown porque aja','\'Awesome idea description...\'','asdasdasdasdaasdasd','https://t2.ev.ltmcdn.com/es/posts/7/9/2/15_curiosidades_de_la_naturaleza_que_te_sorprenderan_1297_600.jpg','sustainability',NULL,'en',NULL,'showme','me','no',0,1,NULL,NULL,NULL,0,'2019-06-13 04:27:49','2019-06-13 04:27:49'),(4,'Inteligencia emocional empresaria','Tus empleados son capacitados lógicamente, pero lo son emocinalmente?','<p style=\"margin-bottom: 28px; font-size: 18px; font-family: &quot;Open Sans&quot;, sans-serif; text-align: justify;\">Tomar decisiones es algo que, sinceramente, cuesta a muchos. Sin embargo, queramos o no, estamos abocados a ello, es inevitable. ¿Por qué? Porque vivimos, y vivir implica decidir. Lo contrario es dormir.</p><p style=\"margin-bottom: 28px; font-size: 18px; font-family: &quot;Open Sans&quot;, sans-serif; text-align: justify;\">Ciertamente es más cómodo no hacerlo, pero asumir un papel en la vida y sacar adelante nuestros proyectos (personales, profesionales, económicos) implica tomar postura, posicionarse, optar, elegir, escoger.. . En definitiva, reafirmarse y manifestar quién es uno o una&nbsp;<span class=\"\">y practicar la<span class=\"ecxApple-converted-space\">&nbsp;</span><a class=\"\" href=\"http://agustingrau.com/autosuperacion/\" target=\"_blank\" style=\"background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; transition: all 0.2s ease-in-out 0s; color: rgb(104, 134, 184); text-decoration-line: underline;\">autosuperación</a><span class=\"ecxApple-converted-space\">&nbsp;</span>en cada momento</span></p><blockquote style=\"font-family: &quot;Arbutus Slab&quot;, serif; margin: 40px; font-size: 18px;\"><p style=\"margin-bottom: 28px; font-size: 1em;\"><span style=\"color: rgb(153, 153, 153);\"><span style=\"font-weight: 700;\">&nbsp;</span><em>«Nuestra indecisión hace que la manifestación de lo que queremos sea casi imposible»&nbsp;</em>Joe Vitale. -El poder de la atracción-.</span></p><p style=\"margin-bottom: 28px; font-size: 1em; text-align: justify;\"><a href=\"https://accionconalegria.com/wp-content/uploads/2015/04/Agustin_04_01.jpg\" style=\"background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; transition: all 0.2s ease-in-out 0s; color: rgb(104, 134, 184); text-decoration-line: underline;\"><img class=\"size-large wp-image-4063\" src=\"https://accionconalegria.com/wp-content/uploads/2015/04/Agustin_04_01-800x534.jpg\" alt=\"Agustin_04_01\" width=\"740\" height=\"494\" srcset=\"https://accionconalegria.com/wp-content/uploads/2015/04/Agustin_04_01-800x534.jpg 800w, https://accionconalegria.com/wp-content/uploads/2015/04/Agustin_04_01-300x200.jpg 300w, https://accionconalegria.com/wp-content/uploads/2015/04/Agustin_04_01.jpg 1000w\" sizes=\"(max-width: 740px) 100vw, 740px\" style=\"border: 0px; max-width: 100%; height: auto;\"></a></p></blockquote><p style=\"margin-bottom: 28px; font-size: 18px; font-family: &quot;Open Sans&quot;, sans-serif; text-align: justify;\"><span style=\"color: rgb(255, 153, 0);\">&nbsp;<span style=\"font-weight: 700;\">¿QUÉ PREGUNTAS DEBERÍAMOS HACERNOS A LA HORA DE TOMAR NUESTRAS DECISIONES?</span></span></p><p style=\"margin-bottom: 28px; font-size: 18px; font-family: &quot;Open Sans&quot;, sans-serif; text-align: justify;\">No olvidemos que para obtener una buena respuesta hay que hacerse una buena pregunta.</p><p style=\"margin-bottom: 28px; font-size: 18px; font-family: &quot;Open Sans&quot;, sans-serif; text-align: justify;\">Raimon Samsó, en su libro&nbsp;<em>100 preguntas que cambiarán tu vida en menos de una hora</em>, nos dice que una persona extraordinaria es una persona ordinaria que se formula preguntas extraordinarias. Y yo, si lo dice Raimon, me hago preguntas e invito a los demás a que se las hagan.</p><p style=\"margin-bottom: 28px; font-size: 18px; font-family: &quot;Open Sans&quot;, sans-serif; text-align: justify;\">Por ejemplo, y a la hora de tomar decisiones:</p><ul style=\"margin-bottom: 28px; margin-left: 40px; padding-left: 0px; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 18px; text-align: justify;\"><li style=\"list-style-type: disc;\">¿Qué quiero conseguir con esto?</li><li style=\"list-style-type: disc;\">¿Porqué lo hago?</li><li style=\"list-style-type: disc;\">¿Estoy convencido de quererlo?</li><li style=\"list-style-type: disc;\">¿Necesito hacerlo?</li><li style=\"list-style-type: disc;\">¿Me va a llevar a donde quiero ir?</li><li style=\"list-style-type: disc;\">¿Me va a empoderar o me va a debilitar?</li><li style=\"list-style-type: disc;\">¿Es acorde a lo que siento en el fondo de mi ser?…</li></ul><p style=\"margin-bottom: 28px; font-size: 18px; font-family: &quot;Open Sans&quot;, sans-serif; text-align: justify;\"><span style=\"color: rgb(255, 153, 0);\">&nbsp;<span style=\"font-weight: 700;\">¿Y QUÉ HERRAMIENTAS UTILIZAMOS PARA HALLAR LA RESPUESTA?</span></span></p><p style=\"margin-bottom: 28px; font-size: 18px; font-family: &quot;Open Sans&quot;, sans-serif; text-align: justify;\">A nuestro alcance tenemos distintas posibilidades, aunque no todas ellas sean buenas compañeras de viaje (o al menos siempre).</p><p style=\"margin-bottom: 28px; font-size: 18px; font-family: &quot;Open Sans&quot;, sans-serif; text-align: justify;\"><span style=\"font-weight: 700;\"># 1.- Escuchar la opinión de los demás.</span>&nbsp;Puede estar bien siempre que:</p><ul style=\"margin-bottom: 28px; margin-left: 40px; padding-left: 0px; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 18px; text-align: justify;\"><li style=\"list-style-type: disc;\">sepamos distinguir lo que es «escuchar» y lo que es «seguir sin más, obedecer sin más», y</li><li style=\"list-style-type: disc;\">no nos paralicemos ante la variedad y diversidad de opiniones ajenas. ¡Cada uno tiene una opinión! ¿Realmente te apoya escuchar tantas opiniones contradictorias?</li></ul><p style=\"margin-bottom: 28px; font-size: 18px; font-family: &quot;Open Sans&quot;, sans-serif; text-align: justify;\">&nbsp;<span style=\"font-weight: 700;\"># 2.- Utilizar la mente</span></p><p style=\"margin-bottom: 28px; font-size: 18px; font-family: &quot;Open Sans&quot;, sans-serif; text-align: justify;\">La mente es una herramienta que sirve para pensar, de acuerdo a los cánones de la lógica y la razón. Puede ser más o menos útil según el momento en el que estemos, pero no necesariamente para todo. Yo en concreto la utilizo en un momento posterior: cuando ya tengo tomada mi decisión, pero no en el momento previo de tomarla. ¿Qué utilizo para eso? El siguiente punto:</p><p style=\"margin-bottom: 28px; font-size: 18px; font-family: &quot;Open Sans&quot;, sans-serif; text-align: justify;\"><span style=\"font-weight: 700;\"># 3.-</span>&nbsp;<span style=\"font-weight: 700;\">Determinar lo que siento</span>.</p><p style=\"margin-bottom: 28px; font-size: 18px; font-family: &quot;Open Sans&quot;, sans-serif; text-align: justify;\">Interesante cuestión. Por eso merece un subtítulo aparte:</p><p style=\"margin-bottom: 28px; font-size: 18px; font-family: &quot;Open Sans&quot;, sans-serif; text-align: justify;\"><span style=\"text-decoration-line: underline; color: rgb(255, 153, 0);\"><span style=\"font-weight: 700;\">I-ATRÉVETE A SENTIR. ATRÉVETE A SER TÚ.</span></span></p><p style=\"margin-bottom: 28px; font-size: 18px; font-family: &quot;Open Sans&quot;, sans-serif; text-align: justify;\">Una cosa es lo que lo piensas y otra lo que sientes. En una ocasión le pregunté a alguien qué sentía respecto a algo, y empezó diciendo «pues yo pienso…» No, no, perdona. No es lo que piensas, es lo que sientes.</p><p style=\"margin-bottom: 28px; font-size: 18px; font-family: &quot;Open Sans&quot;, sans-serif; text-align: justify;\">¿Y cómo sé lo que siento? Lo sabes. Hay un lugar dentro de ti que es verdad y sinceridad. Ese es el lugar en el que están las respuestas, al menos tus respuestas, que son las únicas que a ti te valen.</p><p style=\"margin-bottom: 28px; font-size: 18px; font-family: &quot;Open Sans&quot;, sans-serif; text-align: justify;\">Ese lugar dentro de ti es el lugar del corazón y el ser interior. Es el lugar en el que tú eres tú desprovist@ de las máscaras, vestimentas y artilugios que usamos en el día a día.</p><p style=\"margin-bottom: 28px; font-size: 18px; font-family: &quot;Open Sans&quot;, sans-serif; text-align: justify;\">Es el lugar en el que no puedes engañarte ni engañar a nadie. Y ese es el lugar al que, a mi juicio, hay que ir para adoptar las decisiones, para hallar las respuestas.</p><p style=\"margin-bottom: 28px; font-size: 18px; font-family: &quot;Open Sans&quot;, sans-serif; text-align: justify;\">En ese lugar hallamos inspiración y creatividad, dejamos que se exprese la intuición, confiamos en nuestras sensaciones y sabemos que lo que hallamos está alineado con nuestros valores, nuestras creencias y nuestra forma de ver el mundo y el universo. En ese lugar, simple y llanamente, somos nosotros, podemos<span class=\"ecxApple-converted-space\">&nbsp;</span><a class=\"\" href=\"http://agustingrau.com/aprender-fluir/\" target=\"_blank\" style=\"background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; transition: all 0.2s ease-in-out 0s; color: rgb(104, 134, 184); text-decoration-line: underline;\">fluir</a>. ¿Qué más se puede pedir? ¿Qué más necesitamos?</p><p style=\"margin-bottom: 28px; font-size: 18px; font-family: &quot;Open Sans&quot;, sans-serif; text-align: justify;\"><span style=\"text-decoration-line: underline; color: rgb(255, 153, 0);\"><span style=\"font-weight: 700;\">II-EL CONOCIMIENTO SILENCIOSO.</span></span></p><p style=\"margin-bottom: 28px; font-size: 18px; font-family: &quot;Open Sans&quot;, sans-serif; text-align: justify;\">Me gusta mucho Carlos Castaneda. Es (era) un autor y antropólogo cuya obra es su autobiografía espiritual. Entre sus libros me encanta «El conocimiento silencioso».</p><p style=\"margin-bottom: 28px; font-size: 18px; font-family: &quot;Open Sans&quot;, sans-serif; text-align: justify;\"><span style=\"font-weight: 700;\">¿Qué es eso?</span></p><p style=\"margin-bottom: 28px; font-size: 18px; font-family: &quot;Open Sans&quot;, sans-serif; text-align: justify;\">Pues el conocimiento que sale de dentro, las respuestas que brotan del interior y que sabes que son ciertas. El conocimiento que no necesita expresarse con palabras porque puede ser simplemente una vibración, una sensación, una impulso de energía, una emoción interior, una oleada de alegría.</p><p style=\"margin-bottom: 28px; font-size: 18px; font-family: &quot;Open Sans&quot;, sans-serif; text-align: justify;\">Hay cosas que, simple y llanamente, sabes que son verdad aunque no sepas cómo nombrarlas, aunque no sepas explicárselas a tu vecino. Que de todas formas no te va a entender y que a ti tampoco te hace falta que te entienda.</p><p style=\"margin-bottom: 28px; font-size: 18px; font-family: &quot;Open Sans&quot;, sans-serif; text-align: justify;\"><span style=\"font-weight: 700;\">¿Qué ventajas tiene el conocimiento silencioso?</span></p><ul style=\"margin-bottom: 28px; margin-left: 40px; padding-left: 0px; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 18px; text-align: justify;\"><li style=\"list-style-type: disc;\">Ayudarnos a descubrir qué queremos y quiénes somos.</li><li style=\"list-style-type: disc;\">Ayudarnos a determinar&nbsp;<a href=\"https://accionconalegria.com/vivir-con-pasion/\" style=\"background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; transition: all 0.2s ease-in-out 0s; color: rgb(104, 134, 184); text-decoration-line: underline;\">nuestras pasiones</a>. Importante tema.</li><li style=\"list-style-type: disc;\">Ayudarnos a tomar decisiones, que en definitiva es el objeto de este post.</li><li style=\"list-style-type: disc;\">Y por último, ayudarnos a algo muy importante, lo cual nos lleva al último punto :</li></ul><p style=\"margin-bottom: 28px; font-size: 18px; font-family: &quot;Open Sans&quot;, sans-serif; text-align: justify;\"><span style=\"text-decoration-line: underline;\"><span style=\"font-weight: 700;\"><span style=\"color: rgb(255, 153, 0);\">&nbsp;III-SALIR DEL EGO Y LA TIRANÍA DE LA MENTE.</span></span></span></p><p style=\"margin-bottom: 28px; font-size: 18px; font-family: &quot;Open Sans&quot;, sans-serif; text-align: justify;\">Para llegar al corazón y adoptar estupendas decisiones (objeto de nuestro post).</p><p style=\"margin-bottom: 28px; font-size: 18px; font-family: &quot;Open Sans&quot;, sans-serif; text-align: justify;\">El ego es el resultado de estructurar y ordenar la realidad con arreglo a los dictados (a la tiranía) de la mente. Es el resultado de pensarlo todo, razonarlo todo, categorizarlo todo, encasillarlo todo… y no dejar espacio para la magia y el encantamiento.</p><p style=\"margin-bottom: 28px; font-size: 18px; font-family: &quot;Open Sans&quot;, sans-serif; text-align: justify;\">El ego nos dice cómo es la realidad y cómo tenemos que comportarnos. Nos empuja a una existencia &nbsp;ordenada, premeditada, predestinada… y nos evita&nbsp;<a href=\"https://accionconalegria.com/el-juego-de-la-vida-en-4-pasos/\" style=\"background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; transition: all 0.2s ease-in-out 0s; color: rgb(104, 134, 184); text-decoration-line: underline;\">el juego de la vida</a>. El ego nos impide ser lo que somos realmente.</p><p style=\"margin-bottom: 28px; font-size: 18px; font-family: &quot;Open Sans&quot;, sans-serif; text-align: justify;\"><span style=\"color: rgb(255, 153, 0);\"><span style=\"font-weight: 700;\">EN DEFINITIVA</span></span></p><p style=\"margin-bottom: 28px; font-size: 18px; font-family: &quot;Open Sans&quot;, sans-serif; text-align: justify;\">Después de mil palabras escritas, ¿qué es lo que quiero decir?</p><ul style=\"margin-bottom: 28px; margin-left: 40px; padding-left: 0px; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 18px; text-align: justify;\"><li style=\"list-style-type: disc;\">Que no deberíamos pensar tanto y sentir más.</li><li style=\"list-style-type: disc;\">Que deberíamos permitirnos ser más nosotros, más libres,&nbsp;<a href=\"http://viviralmaximo.net/me-siento-vacio/\" style=\"background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; transition: all 0.2s ease-in-out 0s; color: rgb(104, 134, 184); text-decoration-line: underline;\">más felices</a>&nbsp;y vivir más en contacto con nuestro ser interior, con lo que somos realmente. Con nuestra verdad y nuestro sello de identidad.</li><li style=\"list-style-type: disc;\">Que podemos&nbsp;<a href=\"http://agustingrau.com/poder-sin-limites-a-robbins/\" style=\"background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; transition: all 0.2s ease-in-out 0s; color: rgb(104, 134, 184); text-decoration-line: underline;\">alcanzar un poder sin límites</a>&nbsp;y hacer que nuestra vida sea fructífera y llena de plenitud (un día se me ocurrieron hasta&nbsp;<a href=\"http://agustingrau.com/100-cosas-hacer-dia-pleno/\" style=\"background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; transition: all 0.2s ease-in-out 0s; color: rgb(104, 134, 184); text-decoration-line: underline;\">100 cosas para hacer que tu día sea&nbsp; pleno</a>).</li></ul>','http://www.miconsulta.es/wp-content/uploads/2018/06/brain-3269655_1920-1100x600.jpg','lifeandhealth',NULL,'en',NULL,'showme','public','no',0,1,NULL,NULL,NULL,0,'2019-06-13 04:28:02','2019-07-25 04:53:23'),(5,'Tutoría de egresados','Enseñar a alguién lo que sabes hace que aprendas aún más!','<p class=\"MsoNormal\" align=\"left\" style=\"margin-top: 21px; margin-bottom: 0px; color: rgb(13, 38, 51); font-size: 15px; font-family: Arial;\"><span lang=\"ES\"><span style=\"color: rgb(0, 0, 0);\">En un mundo cada vez más peligroso y violento, los niños y jóvenes están expuestos a mayores riesgos y peligros. Los padres, a su vez, sienten que sus ocupaciones laborales los agobian destinando menos tiempo a observar cómo se van desarrollando sus hijos y como van formando su personalidad, sus valores, sus talentos… Los problemas se presentan tanto en los centros de enseñanza públicos como privados; algunos de ellos cuentan con más recursos personales y materiales para implementar un servicio de orientación y tutoría, pero en otros las limitaciones de estos recursos son evidentes.</span></span></p><p style=\"margin-top: 21px; margin-bottom: 0px; color: rgb(13, 38, 51); font-size: 15px; font-family: Arial;\"><span id=\"more-388\"></span></p><p class=\"MsoNormal\" align=\"left\" style=\"margin-top: 21px; margin-bottom: 0px; color: rgb(13, 38, 51); font-size: 15px; font-family: Arial;\"><span lang=\"ES\"><span style=\"color: rgb(0, 0, 0);\">El diseño curricular asigna una hora en la carga horaria semanal para la orientación y tutoría. Es indudable que trabajar temas tan complejos que se relacionan con la formación y creación de hábitos de vida y de estudio de los estudiantes en una hora semanal es muy difícil. Por esta razón, estos amp`lios temas deberían trabajarse transversalmente sacándole provecho a toda actividad que en cualquier área de formación lo permita.</span></span></p><p class=\"MsoNormal\" align=\"left\" style=\"margin-top: 21px; margin-bottom: 0px; color: rgb(13, 38, 51); font-size: 15px; font-family: Arial;\"><span lang=\"ES\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></span></p><p class=\"MsoNormal\" align=\"left\" style=\"margin-top: 21px; margin-bottom: 0px; color: rgb(13, 38, 51); font-size: 15px; font-family: Arial;\"><span style=\"color: rgb(0, 0, 0);\"><span lang=\"ES\">En otras palabras, hay que cumplir con una de las finalidades inseparables de toda función docente: hacer efectivo su rol de orientador; rol que tiene diferencias con el de tutor. Como&nbsp;<strong>orientador</strong>, el profesor debe apoyar la construcción de&nbsp;</span><span lang=\"ES-TRAD\">los distintos itinerarios de las personas y las opciones que han de tomar respecto a caminos alternativos. En cambio, el rol del&nbsp;<strong>tutor</strong>es más concreto: responde a la necesidad de educar personas concretas, particulares, individuales, con problemas singulares y con motivaciones y características distintas una a otra. La tutoría supone un acompañamiento al conjunto de alumnos de una clase y a la vez a cada uno de ellos en particular.</span></span></p><p class=\"MsoNormal\" align=\"left\" style=\"margin-top: 21px; margin-bottom: 0px; color: rgb(13, 38, 51); font-size: 15px; font-family: Arial;\"><span lang=\"ES-TRAD\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></span></p><p class=\"MsoNormal\" align=\"left\" style=\"margin-top: 21px; margin-bottom: 0px; color: rgb(13, 38, 51); font-size: 15px; font-family: Arial;\"><b><span lang=\"ES-TRAD\"><span style=\"color: rgb(0, 0, 0);\">Perfil de un tutor</span></span></b></p><p class=\"MsoNormal\" align=\"left\" style=\"margin-top: 21px; margin-bottom: 0px; color: rgb(13, 38, 51); font-size: 15px; font-family: Arial;\"><b><span lang=\"ES-TRAD\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></span></b></p><p class=\"MsoNormal\" style=\"margin-top: 21px; margin-bottom: 0px; color: rgb(13, 38, 51); font-size: 15px; font-family: Arial;\"><span lang=\"ES-TRAD\"><span style=\"color: rgb(0, 0, 0);\">Todo profesor es por naturaleza orientador, pero no todo profesor reúne las características que lo lleven al ejercicio de la tutoría. Se requiere un perfil especial que combine varios requisitos: entre los más importantes están:</span></span></p><p class=\"MsoNormal\" style=\"margin-top: 21px; margin-bottom: 0px; color: rgb(13, 38, 51); font-size: 15px; font-family: Arial;\"><span lang=\"ES-TRAD\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></span></p><p class=\"MsoListParagraphCxSpFirst\" style=\"margin-top: 21px; margin-bottom: 0px; color: rgb(13, 38, 51); font-size: 15px; font-family: Arial;\"><span style=\"color: rgb(0, 0, 0);\"><span lang=\"ES\">1.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><b><span lang=\"ES-TRAD\">D</span></b><b><span lang=\"ES\">isponer de tiempo para realizar su función</span></b><b><span lang=\"ES\">.&nbsp;</span></b><span lang=\"ES\">La tutoría demanda muchas veces más horas que las que obliga la jornada laboral, o cumplir esta en un horario extra. El profesor que asuma el cargo de tutor debe ser consciente de la responsabilidad que asume.</span></span></p><p class=\"MsoListParagraphCxSpFirst\" style=\"margin-top: 21px; margin-bottom: 0px; color: rgb(13, 38, 51); font-size: 15px; font-family: Arial;\"></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top: 21px; margin-bottom: 0px; color: rgb(13, 38, 51); font-size: 15px; font-family: Arial;\"><span style=\"color: rgb(0, 0, 0);\"><span lang=\"ES\">2.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><b><span lang=\"ES\">A</span></b><b><span lang=\"ES\">ceptación&nbsp;</span></b><b><span lang=\"ES\">voluntaria&nbsp;</span></b><b><span lang=\"ES\">del cargo.</span></b>&nbsp;<span lang=\"ES\">El ejercicio de la función de tutor no puede ser impuesto. Nadie hace las cosas bien cuando es obligado; lo terminará haciendo a desgano, lo que se reflejará en el impacto que puede tener el servicio en apoyo de sus estudiantes.</span></span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top: 21px; margin-bottom: 0px; color: rgb(13, 38, 51); font-size: 15px; font-family: Arial;\"></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top: 21px; margin-bottom: 0px; color: rgb(13, 38, 51); font-size: 15px; font-family: Arial;\"><span style=\"color: rgb(0, 0, 0);\"><span lang=\"ES\">3.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><b><span lang=\"ES\">C</span></b><b><span lang=\"ES\">oherencia personal</span></b><b><span lang=\"ES\">.</span></b><span lang=\"ES\">&nbsp;La tarea de orientación se asocia fuertemente a la trasmisión de valores, pautas de conducta, respeto de los demás. Para que el tutor pueda trasmitir estas actitudes tiene que pregonar con el ejemplo.</span></span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top: 21px; margin-bottom: 0px; color: rgb(13, 38, 51); font-size: 15px; font-family: Arial;\"></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top: 21px; margin-bottom: 0px; color: rgb(13, 38, 51); font-size: 15px; font-family: Arial;\"><span style=\"color: rgb(0, 0, 0);\"><span lang=\"ES\">4.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><b><span lang=\"ES\">C</span></b><b><span lang=\"ES\">arisma</span></b><b><span lang=\"ES\">.</span></b><span lang=\"ES\">&nbsp;El tutor debe trasmitir confianza; su modo de actuar debe facilitar el establecimiento de relaciones cordiales y fluidas. Por tanto, no debe ser ni “el malo de la película”, el excesivamente riguroso y a quien todos le temen; pero tampoco aquel que su carácter permite que los estudiantes se excedan llegando incluso a muestras de falta de respeto.&nbsp;&nbsp;</span></span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top: 21px; margin-bottom: 0px; color: rgb(13, 38, 51); font-size: 15px; font-family: Arial;\"></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top: 21px; margin-bottom: 0px; color: rgb(13, 38, 51); font-size: 15px; font-family: Arial;\"><span style=\"color: rgb(0, 0, 0);\"><span lang=\"ES\">5.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><b><span lang=\"ES\">C</span></b><b><span lang=\"ES\">apacidad de comunicación</span></b><b><span lang=\"ES\">.</span></b><span lang=\"ES\">&nbsp;La predisposición al diálogo, a establecer vínculos, a inducir a la conversación de aquellos estudiantes que son tímidos o desconfiados debe ser una cualidad de todo tutor. No hay posibilidad de ayudar a un estudiante con problemas sin comunicación. Además, la&nbsp;</span><span lang=\"ES\">motivación del alumno&nbsp;</span><span lang=\"ES\">la&nbsp;</span><span lang=\"ES\">logra&nbsp;</span><span lang=\"ES\">el tutor&nbsp;</span><span lang=\"ES\">esencialmente a partir de tres condiciones: identificar qué es lo que el alumno hace mejor, saber qué es lo que más le gusta y saber qui</span><span lang=\"ES\">é</span><span lang=\"ES\">nes son sus amigos.</span><span lang=\"ES\">&nbsp;Nuevamente, ayudarlo a descubrir esas cualidades se logra a través de la comunicación.</span></span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top: 21px; margin-bottom: 0px; color: rgb(13, 38, 51); font-size: 15px; font-family: Arial;\"></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top: 21px; margin-bottom: 0px; color: rgb(13, 38, 51); font-size: 15px; font-family: Arial;\"><span style=\"color: rgb(0, 0, 0);\"><b><span lang=\"ES\">6.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></b><b><span lang=\"ES\">I</span></b><b><span lang=\"ES\">ntuición psicológica</span></b><b><span lang=\"ES\">.</span></b><span lang=\"ES\">&nbsp;El profesor no es psicólogo, pero la prevención, el anticiparse, el ir descubriendo cuándo un estudiante está atravesando por un problema es parte de la habilidad que todo tutor debe de poseer. La observación permanente de las conductas y desempeños de cada uno de los estudiantes es una valiosa ayuda en este objetivo.</span></span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top: 21px; margin-bottom: 0px; color: rgb(13, 38, 51); font-size: 15px; font-family: Arial;\"><b></b></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top: 21px; margin-bottom: 0px; color: rgb(13, 38, 51); font-size: 15px; font-family: Arial;\"><span style=\"color: rgb(0, 0, 0);\">7.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<strong>Saber escuchar.&nbsp;</strong>Otra cualidad fundamental es l<span lang=\"ES\">a capacidad para ser receptivo y ponerse en el lugar del estudiante frente a una situación difícil . Ciertamente que no se trata de ocultar actos de indisciplina o dejadez del estudiante, pues son conductas que deben ser corregidas. La referencia va a que se dan situaciones en las que el bajo rendimiento, la desatención, el poco interés por estudiar puede deberse a problemas serios que enfrenta en su hogar o en las propias relaciones con sus compañeros al interior del colegio.</span></span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top: 21px; margin-bottom: 0px; color: rgb(13, 38, 51); font-size: 15px; font-family: Arial;\"></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top: 21px; margin-bottom: 0px; color: rgb(13, 38, 51); font-size: 15px; font-family: Arial;\"><span style=\"color: rgb(0, 0, 0);\"><span lang=\"ES\">8.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><b><span lang=\"ES\">Confidencialidad.</span></b><span lang=\"ES\">&nbsp;La simple capacidad de establecer una conversación con el estudiante no basta. La seriedad en el establecimiento de relaciones es clave. Esa seriedad debe expresarse en la reserva de información de aquello que el estudiante le va contando al profesor. Si un alumno se entera que una situación muy personal es&nbsp;contada por su tutor a otra u otras personas, se habrá perdido la confianza y se dejará de creer en el tutor. Cuando se produzca un hecho que el psicólogo o una autoridad superior de la institución educativa debe conocerlo, entonces el tutor lo conversará previamente con el estudiante y le hará comprender que la información entregada a un tercero únicamente tiene el propósito de ayudarlo a superar un problema.</span></span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top: 21px; margin-bottom: 0px; color: rgb(13, 38, 51); font-size: 15px; font-family: Arial;\"></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top: 21px; margin-bottom: 0px; color: rgb(13, 38, 51); font-size: 15px; font-family: Arial;\"><span style=\"color: rgb(0, 0, 0);\"><span lang=\"ES\">9.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><b><span lang=\"ES\">T</span></b><b><span lang=\"ES\">rabajo a tiempo completo</span></b><b><span lang=\"ES\">.</span></b><span lang=\"ES\">&nbsp;Una jornada laboral a jornada completa es no solo deseable sino indispensable para el ejercicio de la función de tutor. El tutor tiene que vivir plenamente el clima de trabajo del estudiante y del colegio en general; conocer las limitaciones de este clima, colaborar con la dirección de la institución a tratar de superarlos. Además, un trabajo a jornada completa tiene una ventaja: facilita compartir experiencias de ejercicio de la función con otros tutores. Hay problemas que pueden resultar comunes y entre tutores pueden ayudarse y recomendar medidas de trabajo a otros profesores y a la dirección del colegio. Por otro lado el intercambio de experiencias es una actividad pedagógica muy enriquecedora.</span></span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top: 21px; margin-bottom: 0px; color: rgb(13, 38, 51); font-size: 15px; font-family: Arial;\"></p><p class=\"MsoListParagraphCxSpLast\" style=\"margin-top: 21px; margin-bottom: 0px; color: rgb(13, 38, 51); font-size: 15px; font-family: Arial;\"><span style=\"color: rgb(0, 0, 0);\"><span lang=\"ES\">10.&nbsp;&nbsp;</span><b><span lang=\"ES\">Predisposición a seguir aprendiendo, capacitarse.&nbsp;</span></b><span lang=\"ES\">Las mutaciones sociales, la revolución tecnológica, la globalización son, entre otras, variables que influyen en el enfrentamiento de nuevas conductas y riesgos sociales. Así como las normas de convivencia tienen que actualizarse periódicamente, también deben hacerlo las estrategias de trabajo de los tutores. Una forma de hacerlo es proveyéndoles capacitación, materiales autoinstructivos y fomentando en intercambio de ideas sobre temas que incumben a la formación integral del estudiante.</span></span></p><p class=\"MsoNormal\" style=\"margin-top: 21px; margin-bottom: 0px; color: rgb(13, 38, 51); font-size: 15px; font-family: Arial;\"><span lang=\"ES\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></span></p><p class=\"MsoNormal\" style=\"margin-top: 21px; margin-bottom: 0px; color: rgb(13, 38, 51); font-size: 15px; font-family: Arial;\"><span lang=\"ES\"><span style=\"color: rgb(0, 0, 0);\">Como se ha señalado en párrafo precedente, para organizar el servicio de tutoría se presentan algunas facilidades pero también algunas dificultades. Entre las primeras está la voluntad de muchos profesores de asumir tal responsabilidad, su compromiso e identificación con el colegio y el deseo de apoyar un proceso de formación integral del estudiante. Algunos colegios privados ofrecen a quienes ejercen la tutoría una bonificación por las horas extra dedicadas; otros les exoneran de un determinado número de horas de clase. Además, en la mayor parte de ellos hay un psicólogo&nbsp;que complementa&nbsp;y apoya el trabajo de los tutores. Cuando no lo existe por problemas presupuestarios se puede contratar practicantes o recurrir a jóvenes que trabajan en grupos como las pastorales. No hay que olvidar que el mejor amigo de un joven es otro joven.</span></span></p><p class=\"MsoNormal\" style=\"margin-top: 21px; margin-bottom: 0px; color: rgb(13, 38, 51); font-size: 15px; font-family: Arial;\"></p><p class=\"MsoNormal\" style=\"margin-top: 21px; margin-bottom: 0px; color: rgb(13, 38, 51); font-size: 15px; font-family: Arial;\"><span lang=\"ES\"><span style=\"color: rgb(0, 0, 0);\">La situación en la escuela pública es más complicada pues el Ministerio de Economía y Finanzas calcula la remuneración del profesor en función del número de horas de clase efectivamente dictadas. Es por ello que pocos profesores quieren ejercer la función de tutoría, no obstante que en la escuela pública hay quizá una mayor necesidad de su implementación. Además, el cargo de psicólogo va desapareciendo en la escuela pública siendo una necesidad.</span></span></p><p class=\"MsoNormal\" style=\"margin-top: 21px; margin-bottom: 0px; color: rgb(13, 38, 51); font-size: 15px; font-family: Arial;\"><span lang=\"ES\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></span></p><p class=\"MsoNormal\" style=\"margin-top: 21px; margin-bottom: 0px; color: rgb(13, 38, 51); font-size: 15px; font-family: Arial;\"><span lang=\"ES\"><span style=\"color: rgb(0, 0, 0);\">Si se quiere que la tutoría cumpla sus finalidades los problemas de carga horaria, de reconocimiento por la labor adicional que el tutr cumple y de apoyo de un profesional psicólogo deberían solucionarse. &nbsp;</span></span></p><p class=\"MsoNormal\" style=\"margin-top: 21px; margin-bottom: 0px; color: rgb(13, 38, 51); font-size: 15px; font-family: Arial;\"><span lang=\"ES\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></span></p><p class=\"MsoNormal\" style=\"margin-top: 21px; margin-bottom: 0px; color: rgb(13, 38, 51); font-size: 15px; font-family: Arial;\"><b><span lang=\"ES\"><span style=\"color: rgb(0, 0, 0);\">¿Qué funciones debe realizar un tutor?</span></span></b></p><p class=\"MsoNormal\" style=\"margin-top: 21px; margin-bottom: 0px; color: rgb(13, 38, 51); font-size: 15px; font-family: Arial;\"><span lang=\"ES\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></span></p><p class=\"MsoNormal\" style=\"margin-top: 21px; margin-bottom: 0px; color: rgb(13, 38, 51); font-size: 15px; font-family: Arial;\"><span lang=\"ES\"><span style=\"color: rgb(0, 0, 0);\">Entre las principales podemos destacar las siguientes:</span></span></p><p class=\"MsoNormal\" style=\"margin-top: 21px; margin-bottom: 0px; color: rgb(13, 38, 51); font-size: 15px; font-family: Arial;\"><span lang=\"ES\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></span></p><p class=\"MsoNormal\" style=\"margin-top: 21px; margin-bottom: 0px; color: rgb(13, 38, 51); font-size: 15px; font-family: Arial;\"><span style=\"color: rgb(0, 0, 0);\"><span lang=\"ES\">1.&nbsp;&nbsp;&nbsp;&nbsp;</span><b><span lang=\"ES\">Liderazgo.&nbsp;</span></b><span lang=\"ES\">Ser la cabeza de todo lo que sucede en el aula y responsable por la ejecución de las directivas y decisiones impartidas.</span></span></p><p class=\"MsoNormal\" style=\"margin-top: 21px; margin-bottom: 0px; color: rgb(13, 38, 51); font-size: 15px; font-family: Arial;\"></p><p class=\"MsoNormal\" style=\"margin-top: 21px; margin-bottom: 0px; color: rgb(13, 38, 51); font-size: 15px; font-family: Arial;\"><span style=\"color: rgb(0, 0, 0);\"><span lang=\"ES\">2.&nbsp;&nbsp;&nbsp;&nbsp;</span><b><span lang=\"ES\">Orientar el desarrollo personal de cada estudiante.&nbsp;</span></b><span lang=\"ES\">Valorar al estudiante tal como es; en sus posibilidades y limitaciones. Utilizar a algunos de ellos para estimular o fortalecer el desarrollo personal de cada escolar.</span></span></p><p class=\"MsoNormal\" style=\"margin-top: 21px; margin-bottom: 0px; color: rgb(13, 38, 51); font-size: 15px; font-family: Arial;\"></p><p class=\"MsoNormal\" style=\"margin-top: 21px; margin-bottom: 0px; color: rgb(13, 38, 51); font-size: 15px; font-family: Arial;\"><span style=\"color: rgb(0, 0, 0);\"><span lang=\"ES\">3.&nbsp;&nbsp;&nbsp;&nbsp;</span><b><span lang=\"ES\">Representar la sección.</span></b>&nbsp;<span lang=\"ES\">Ser el vínculo que&nbsp;</span><span lang=\"ES\">la&nbsp;</span><span lang=\"ES\">simboliza. Forjar el aula como una unidad educativa, planificando con los alumnos y los&nbsp;</span><span lang=\"ES\">otros&nbsp;</span><span lang=\"ES\">profesores de la sección&nbsp;</span><span lang=\"ES\">-cuando los haya-&nbsp;</span><span lang=\"ES\">las actividades del año. Presentar los informes correspondientes a la dirección del colegio.</span></span></p><p class=\"MsoNormal\" style=\"margin-top: 21px; margin-bottom: 0px; color: rgb(13, 38, 51); font-size: 15px; font-family: Arial;\"></p><p class=\"MsoNormal\" style=\"margin-top: 21px; margin-bottom: 0px; color: rgb(13, 38, 51); font-size: 15px; font-family: Arial;\"><span style=\"color: rgb(0, 0, 0);\"><span lang=\"ES\">4.&nbsp;&nbsp;&nbsp;&nbsp;</span><b><span lang=\"ES\">Coordina</span></b><b><span lang=\"ES\">ción.&nbsp;</span></b><span lang=\"ES\">C</span><span lang=\"ES\">on otros profesores de la sección a su cargo</span><span lang=\"ES\">&nbsp;en temas relacionados con:</span></span></p><p class=\"MsoListParagraphCxSpFirst\" style=\"margin-top: 21px; margin-bottom: 0px; color: rgb(13, 38, 51); font-size: 15px; font-family: Arial;\"><span style=\"color: rgb(0, 0, 0);\"><span lang=\"ES\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span lang=\"ES\">L</span><span lang=\"ES\">a información que tienen acerca de los diversos alumnos;</span></span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top: 21px; margin-bottom: 0px; color: rgb(13, 38, 51); font-size: 15px; font-family: Arial;\"><span style=\"color: rgb(0, 0, 0);\"><span lang=\"ES\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span lang=\"ES\">L</span><span lang=\"ES\">a programación y evaluación general de actividades de la sección;</span></span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top: 21px; margin-bottom: 0px; color: rgb(13, 38, 51); font-size: 15px; font-family: Arial;\"><span style=\"color: rgb(0, 0, 0);\"><span lang=\"ES\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span lang=\"ES\">E</span><span lang=\"ES\">l ajuste de las programaciones al grupo de alumnos, especialmente en lo referente a las respuestas educativas a las necesidades especiales y/o de apoyo;</span></span></p><p class=\"MsoListParagraphCxSpLast\" style=\"margin-top: 21px; margin-bottom: 0px; color: rgb(13, 38, 51); font-size: 15px; font-family: Arial;\"><span style=\"color: rgb(0, 0, 0);\"><span lang=\"ES\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span lang=\"ES\">L</span><span lang=\"ES\">a identificación del interés del alumno por determinados aspectos de la vida o el trabajo para estimular su deseo de aprender y comportarse correctamente, así como para que pueda conseguir éxitos.</span></span></p><p class=\"MsoNormal\" style=\"margin-top: 21px; margin-bottom: 0px; color: rgb(13, 38, 51); font-size: 15px; font-family: Arial;\"><span style=\"color: rgb(0, 0, 0);\"><span lang=\"ES\">5.&nbsp;&nbsp;&nbsp;&nbsp;</span><span lang=\"ES\"><strong>Tener a cargo la hora de tutoría</strong>. Algunos, aunque pocos&nbsp;colegios que trabajan en horarios mayores que los de la jornada oficial de las escuelas públicas dedican más de una hora a está área formativa.</span></span></p><p class=\"MsoNormal\" style=\"margin-top: 21px; margin-bottom: 0px; color: rgb(13, 38, 51); font-size: 15px; font-family: Arial;\"><span style=\"color: rgb(0, 0, 0);\"><span lang=\"ES\">6.&nbsp;&nbsp;&nbsp;&nbsp;</span><span lang=\"ES\"><strong>Comunicarse.</strong>&nbsp;Establecer enlace con los padres de familia, alumnos, colegas, directivos y otros,</span></span></p><p class=\"MsoNormal\" style=\"margin-top: 21px; margin-bottom: 0px; color: rgb(13, 38, 51); font-size: 15px; font-family: Arial;\"><span style=\"color: rgb(0, 0, 0);\"><span lang=\"ES\">7.&nbsp;&nbsp;&nbsp;&nbsp;</span><span lang=\"ES\"><strong>Opinar.</strong>&nbsp;Tener presencia y voz en cualquier asunto que compete a disciplina, rendimiento, sanciones o actividades que involucren a la sección a su cargo.</span></span></p><p class=\"MsoNormal\" style=\"margin-top: 21px; margin-bottom: 0px; color: rgb(13, 38, 51); font-size: 15px; font-family: Arial;\"><span style=\"color: rgb(0, 0, 0);\"><span lang=\"ES\">8.&nbsp;&nbsp;&nbsp;&nbsp;</span><span lang=\"ES\"><strong>Aportar.</strong>&nbsp;Contribuir a desarrollar líneas comunes con los demás tutores en el marco del proyecto curricular.</span></span></p>','https://planfija.ceoearagon.es/files/images/thumbnails/blog_image/files/images/blog/tutor-laboral-formacion-profesional-SDmXOhd0.jpeg','sustainability',NULL,'en',NULL,'showme','public','no',0,1,NULL,NULL,NULL,0,'2019-06-19 22:16:51','2019-07-25 04:58:15'),(6,'Sincronizar Asakaa Innova con aplicación celular','De esta manera podemos usarla en el teléfono para completar ideas.','<div id=\"gt-src-c\" class=\"g-unit\" style=\"background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; border: 0px; vertical-align: baseline; outline-style: initial; outline-width: 0px; color: rgb(128, 128, 128); font-family: Raleway, sans-serif; font-size: 15px;\"><p style=\"background: 0px 0px; border: 0px; margin-top: 10px; margin-bottom: 10px; vertical-align: baseline; outline-style: initial; outline-width: 0px;\">Asakaa es una gran aplicación de gestión de tareas multiplataforma. Puedes organizar las tareas de dos formas diferentes: Por fecha de vencimiento o por categoría. Al organizar por fecha te ofrece cuatro tipos de listas: Hoy, mañana, próximamente, y algún día. Por otro lado puedes crear tus propias categorías u organizar tus tareas por Personal, Trabajo y Negocio.</p></div><div class=\"g-unit\" style=\"background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; border: 0px; vertical-align: baseline; outline-style: initial; outline-width: 0px; color: rgb(128, 128, 128); font-family: Raleway, sans-serif; font-size: 15px;\"><p style=\"background: 0px 0px; border: 0px; margin-top: 10px; margin-bottom: 10px; vertical-align: baseline; outline-style: initial; outline-width: 0px;\">Puedes ver todas esas listas en la misma página para tener una visión amplia de tu agenda semanal o de todos tus proyectos.</p><p style=\"background: 0px 0px; border: 0px; margin-top: 10px; margin-bottom: 10px; vertical-align: baseline; outline-style: initial; outline-width: 0px;\">Con un plan Premium, puedes compartir tus listas con otras personas y recibir un recordatorio cuando se acerque el momento de completar una tarea. También podrás utilizar la herramienta Asistente de Any.do para tener un asistente personal que te ayude a finalizar tus tareas.</p><p style=\"background: 0px 0px; border: 0px; margin-top: 10px; margin-bottom: 10px; vertical-align: baseline; outline-style: initial; outline-width: 0px;\">Precio: Gratis o $ 2.99 al mes por el plan Premium.</p><p style=\"background: 0px 0px; border: 0px; margin-top: 10px; margin-bottom: 10px; vertical-align: baseline; outline-style: initial; outline-width: 0px;\"><img class=\"aligncenter size-full wp-image-24450\" src=\"https://www.lancetalent.com/blog/wp-content/uploads/Captura-de-pantalla-2017-06-19-a-las-11.26.07.png\" alt=\"any.do\" width=\"1000\" height=\"504\" srcset=\"https://www.lancetalent.com/blog/wp-content/uploads/Captura-de-pantalla-2017-06-19-a-las-11.26.07.png 1000w, https://www.lancetalent.com/blog/wp-content/uploads/Captura-de-pantalla-2017-06-19-a-las-11.26.07-300x151.png 300w, https://www.lancetalent.com/blog/wp-content/uploads/Captura-de-pantalla-2017-06-19-a-las-11.26.07-768x387.png 768w\" sizes=\"(max-width: 1000px) 100vw, 1000px\" style=\"max-width: 100%; height: auto; display: block; margin: 10px auto;\"></p></div>','https://cdn.vox-cdn.com/thumbor/ldiYGoZkCY4zWg5Qvu58ug3t7F0=/0x0:2040x1360/1200x800/filters:focal(913x731:1239x1057)/cdn.vox-cdn.com/uploads/chorus_image/image/59542711/akrales_180426_2511_0019.0.jpg','scienceandtechnology',NULL,'es',NULL,'showme','public','no',0,1,NULL,NULL,NULL,0,'2019-07-01 22:02:58','2019-07-25 04:35:14'),(7,'Psicología empresarial','Charlas mensuales en grupo o individual para empleados','<p style=\"box-sizing: border-box; margin-top: 8px; margin-bottom: 8px; font-family: &quot;Source Sans Pro&quot;; font-size: 18px; color: rgb(89, 69, 112);\">Para muchas personas&nbsp;<span style=\"box-sizing: border-box; font-weight: 600;\">ir al psicólogo es sinónimo de ser una persona débil</span>, pero en realidad, acudir a terapia psicológica te puede convertir en una persona más fuerte emocionalmente, y te puede aportar herramientas para poder&nbsp;<span style=\"box-sizing: border-box; font-weight: 600;\">adaptarte mejor</span>&nbsp;a las situaciones difíciles que pueden presentarse al largo de tu vida.</p><h2 style=\"box-sizing: border-box; margin-top: 40px; margin-bottom: 16px; font-family: &quot;Source Sans Pro&quot;; font-size: 28px; line-height: 32px; font-weight: 600; color: rgb(47, 35, 91);\">¿Cuándo acudir a un psicólogo?</h2><p style=\"box-sizing: border-box; margin-top: 8px; margin-bottom: 8px; font-family: &quot;Source Sans Pro&quot;; font-size: 18px; color: rgb(89, 69, 112);\">Por tanto,&nbsp;<span style=\"box-sizing: border-box; font-weight: 600;\">acudir a terapia es un acto de inteligencia y de valentía</span>, ya que en muchas ocasiones la persona que necesita ayuda no es consciente de que tiene el problema o evita afrontar la realidad. Muchas personas desconocen aún en qué momento deberían pensar en acudir a un psicólogo, sobre todo por las falsas creencias sobre qué es la psicoterapia y a quién va dirigida. En este sentido, te recomendamos que leas este artículo:</p><blockquote style=\"box-sizing: border-box; padding: 30px; margin-bottom: 0px; float: right; width: 380px; color: rgb(89, 69, 112); font-family: &quot;Source Sans Pro&quot;, Arial, sans-serif; font-size: 16px;\"><a href=\"https://psicologiaymente.com/clinica/razones-deberias-acudir-al-psicologo\" target=\"_blank\" rel=\"noopener\" style=\"box-sizing: border-box; background: rgb(255, 255, 255); transition: all 0.2s ease 0s; font-family: &quot;Source Sans Pro&quot;; font-weight: 600; color: rgb(84, 0, 211); border-bottom: 1px solid rgba(84, 0, 211, 0.6);\">Las 8 razones por la que deberías acudir a un psicólogo</a></blockquote><p style=\"box-sizing: border-box; margin-top: 8px; margin-bottom: 8px; font-family: &quot;Source Sans Pro&quot;; font-size: 18px; color: rgb(89, 69, 112);\">Un&nbsp;<span style=\"box-sizing: border-box; font-weight: 600;\">psicoterapeuta</span>&nbsp;es un profesional de la salud mental especializado en las áreas cognitiva (pensamiento), afectiva (emociones) y comportamental (conducta), y que&nbsp;<span style=\"box-sizing: border-box; font-weight: 600;\">te puede ayudar a empoderarte frente a las circunstancias del día a día y a mejorar tu calidad de vida</span>.&nbsp;</p><p style=\"box-sizing: border-box; margin-top: 8px; margin-bottom: 8px; font-family: &quot;Source Sans Pro&quot;; font-size: 18px; color: rgb(89, 69, 112);\">Por eso, a continuación te presentamos los&nbsp;<span style=\"box-sizing: border-box; font-weight: 600;\">beneficios que aporta la terapia psicológica</span>.</p><h3 style=\"box-sizing: border-box; margin-top: 40px; margin-bottom: 16px; font-family: &quot;Source Sans Pro&quot;; font-size: 24px; line-height: 28px; font-weight: 600; color: rgb(47, 35, 91);\">1. Te ayuda a sentirte mejor</h3><p style=\"box-sizing: border-box; margin-top: 8px; margin-bottom: 8px; font-family: &quot;Source Sans Pro&quot;; font-size: 18px; color: rgb(89, 69, 112);\">Al enfrentar junto a un psicoterapeuta aquellos problemas que te causan dolor o malestar, y poder hablar con confianza y con libertad sobre uno mismo a alguien que no te juzga sobre tus sentimientos y tus experiencias reprimidas, estás dejando expresar tus pensamientos y sensaciones&nbsp;ocultos, lo cual&nbsp;<span style=\"box-sizing: border-box; font-weight: 600;\">es beneficioso para el bienestar</span>.&nbsp;</p><p style=\"box-sizing: border-box; margin-top: 8px; margin-bottom: 8px; font-family: &quot;Source Sans Pro&quot;; font-size: 18px; color: rgb(89, 69, 112);\">Cuando le expresas cómo te sientes y liberas tu carga emocional, te sientes aliviado. Esto se conoce como&nbsp;<a href=\"https://psicologiaymente.com/psicologia/catarsis-liberacion-emocional\" target=\"_blank\" rel=\"noopener\" style=\"box-sizing: border-box; background: rgb(255, 255, 255); transition: all 0.2s ease 0s; font-weight: 600; color: rgb(84, 0, 211); border-bottom: 1px solid rgba(84, 0, 211, 0.6);\">catarsis</a>, una palabra griega que se refiere a purificación y es usada en psicología para explicar el proceso de liberación de las emociones negativas.</p><h3 style=\"box-sizing: border-box; margin-top: 40px; margin-bottom: 16px; font-family: &quot;Source Sans Pro&quot;; font-size: 24px; line-height: 28px; font-weight: 600; color: rgb(47, 35, 91);\">2. Te enseña herramientas para manejar conflictos</h3><p style=\"box-sizing: border-box; margin-top: 8px; margin-bottom: 8px; font-family: &quot;Source Sans Pro&quot;; font-size: 18px; color: rgb(89, 69, 112);\">Los&nbsp;<span style=\"box-sizing: border-box; font-weight: 600;\">conflictos</span>&nbsp;son algo normal en la vida de las personas y, en muchas ocasiones, son necesarios para el crecimiento personal o la convivencia con otros individuos. Las sesiones de psicoterapia te enseñan nuevas maneras (<span style=\"box-sizing: border-box; font-weight: 600;\">más adaptativas</span>) de solucionar problemas.&nbsp;</p><p style=\"box-sizing: border-box; margin-top: 8px; margin-bottom: 8px; font-family: &quot;Source Sans Pro&quot;; font-size: 18px; color: rgb(89, 69, 112);\">Además, te puede ayudar a percibir los conflictos de forma distinta, para que te afecten menos y<span style=\"box-sizing: border-box; font-weight: 600;\">seas capaz de relativizar&nbsp;</span>la importancia de las situaciones tensas. De esta manera, tu forma de adaptarse a las circunstancias novedosas del día a día será mucho mejor y, en general, tendrás menos dificultades en tus relaciones personales o incluso en el ámbito profesional.</p><h3 style=\"box-sizing: border-box; margin-top: 40px; margin-bottom: 16px; font-family: &quot;Source Sans Pro&quot;; font-size: 24px; line-height: 28px; font-weight: 600; color: rgb(47, 35, 91);\">3. Te ayuda a cambiar las creencias limitantes</h3><p style=\"box-sizing: border-box; margin-top: 8px; margin-bottom: 8px; font-family: &quot;Source Sans Pro&quot;; font-size: 18px; color: rgb(89, 69, 112);\">Con nuestras&nbsp;<span style=\"box-sizing: border-box; font-weight: 600;\">creencias y valores</span>&nbsp;damos significado y coherencia a nuestro modelo de mundo. Una misma situación puede ser vivida de forma distinta por cada persona. Las creencias nos ayudan en definitiva, a simplificar el mundo que nos rodea, y son interpretaciones de la realidad y no hechos constatados.</p><p style=\"box-sizing: border-box; margin-top: 8px; margin-bottom: 8px; font-family: &quot;Source Sans Pro&quot;; font-size: 18px; color: rgb(89, 69, 112);\">Algunas creencias son desadaptativas o limitantes y es necesario corregirlas, pues éstas no son innatas, las vamos adquiriendo a lo largo de nuestra vida. Por ello,&nbsp;<span style=\"box-sizing: border-box; font-weight: 600;\">el psicólogo puede ayudarte a identificarlas, analizarlas, ponerlas a prueba y modificarlas</span>.</p><h3 style=\"box-sizing: border-box; margin-top: 40px; margin-bottom: 16px; font-family: &quot;Source Sans Pro&quot;; font-size: 24px; line-height: 28px; font-weight: 600; color: rgb(47, 35, 91);\">4. Te ayuda a vivir en armonía contigo mismo y con los demás</h3><p style=\"box-sizing: border-box; margin-top: 8px; margin-bottom: 8px; font-family: &quot;Source Sans Pro&quot;; font-size: 18px; color: rgb(89, 69, 112);\">La&nbsp;<span style=\"box-sizing: border-box; font-weight: 600;\">introspección</span>&nbsp;que se lleva a cabo al asistir a terapia te permite conocerte mejor y superar, por ejemplo, una&nbsp;<a href=\"https://psicologiaymente.com/psicologia/crisis-existencial-sentido-vida\" target=\"_blank\" rel=\"noopener\" style=\"box-sizing: border-box; background: rgb(255, 255, 255); transition: all 0.2s ease 0s; font-weight: 600; color: rgb(84, 0, 211); border-bottom: 1px solid rgba(84, 0, 211, 0.6);\">crisis existencial</a>. Además, la psicoterapia es efectiva para los problemas laborales (<a href=\"https://psicologiaymente.com/organizaciones/burnout-sindrome-del-quemado\" target=\"_blank\" rel=\"noopener\" style=\"box-sizing: border-box; background: rgb(255, 255, 255); transition: all 0.2s ease 0s; font-weight: 600; color: rgb(84, 0, 211); border-bottom: 1px solid rgba(84, 0, 211, 0.6);\">burnout</a>, estrés, etc.) o los problemas de pareja.&nbsp;</p><p style=\"box-sizing: border-box; margin-top: 8px; margin-bottom: 8px; font-family: &quot;Source Sans Pro&quot;; font-size: 18px; color: rgb(89, 69, 112);\">Por tanto, la terapia psicológica puede ayudarte a solucionar este tipo de problemas, y&nbsp;<span style=\"box-sizing: border-box; font-weight: 600;\">es beneficiosa para encontrarte a ti mismo y para relacionarte con los demás de manera más efectiva</span>. Esto va a afectar positivamente a tu salud mental, y te permitirá encontrar la paz interior y el bienestar.</p><h3 style=\"box-sizing: border-box; margin-top: 40px; margin-bottom: 16px; font-family: &quot;Source Sans Pro&quot;; font-size: 24px; line-height: 28px; font-weight: 600; color: rgb(47, 35, 91);\">5. Confidencialidad de las sesiones</h3><p style=\"box-sizing: border-box; margin-top: 8px; margin-bottom: 8px; font-family: &quot;Source Sans Pro&quot;; font-size: 18px; color: rgb(89, 69, 112);\">La relación con el psicólogo&nbsp;<span style=\"box-sizing: border-box; font-weight: 600;\">es confidencial y estrictamente profesional</span>. Tal y como se expresa en el código ético y deontológico del&nbsp;<em style=\"box-sizing: border-box;\">Colegio Oficial de Psicólogos</em>, el profesional de la psicología debe garantizar el secreto y la confidencialidad de todo lo referido por quien le consulta.&nbsp;</p><p style=\"box-sizing: border-box; margin-top: 8px; margin-bottom: 8px; font-family: &quot;Source Sans Pro&quot;; font-size: 18px; color: rgb(89, 69, 112);\">Por tanto, todo lo que digas en una sesión terapéutica será un secreto entre tu terapeuta y tú. Esto permite que haya un marco relacional en el que se pueden tratar miedos muy íntimos.</p><h3 style=\"box-sizing: border-box; margin-top: 40px; margin-bottom: 16px; font-family: &quot;Source Sans Pro&quot;; font-size: 24px; line-height: 28px; font-weight: 600; color: rgb(47, 35, 91);\">6. Relación de confianza y empatía</h3><p style=\"box-sizing: border-box; margin-top: 8px; margin-bottom: 8px; font-family: &quot;Source Sans Pro&quot;; font-size: 18px; color: rgb(89, 69, 112);\">Además del conocimiento y la profesionalidad que debe mostrar el psicólogo,&nbsp;<span style=\"box-sizing: border-box; font-weight: 600;\">el entorno de confianza que se crea entre ambos te va a permitir expresar los problemas y sentimientos</span>&nbsp;que consideras más delicados (y que posiblemente no le contarías a nadie más).&nbsp;</p><p style=\"box-sizing: border-box; margin-top: 8px; margin-bottom: 8px; font-family: &quot;Source Sans Pro&quot;; font-size: 18px; color: rgb(89, 69, 112);\">El psicólogo no te va a juzgar y, además, tiene la formación necesaria para crear un buen entorno de confianza y empatía para que te expreses sin temor.</p><h3 style=\"box-sizing: border-box; margin-top: 40px; margin-bottom: 16px; font-family: &quot;Source Sans Pro&quot;; font-size: 24px; line-height: 28px; font-weight: 600; color: rgb(47, 35, 91);\">7. Asesoramiento profesional</h3><p style=\"box-sizing: border-box; margin-top: 8px; margin-bottom: 8px; font-family: &quot;Source Sans Pro&quot;; font-size: 18px; color: rgb(89, 69, 112);\">El psicoterapeuta es un experto en la terapia psicológica, y&nbsp;<span style=\"box-sizing: border-box; font-weight: 600;\">tiene amplios conocimientos sobre la conducta humana</span>, pues ha cursado sus&nbsp;<a href=\"https://psicologiaymente.com/psicologia/por-que-estudiar-psicologia\" target=\"_blank\" rel=\"noopener\" style=\"box-sizing: border-box; background: rgb(255, 255, 255); transition: all 0.2s ease 0s; font-weight: 600; color: rgb(84, 0, 211); border-bottom: 1px solid rgba(84, 0, 211, 0.6);\">estudios de psicología</a>&nbsp;en una universitaria reglada. Para llegar a trabajar de psicoterapeuta, es muy posible que haya cursado algún&nbsp;<span style=\"box-sizing: border-box; font-weight: 600;\">posgrado universitario</span>&nbsp;sobre alguna especialidad (por ejemplo,&nbsp;<a href=\"https://psicologiaymente.com/sexologia\" target=\"_blank\" rel=\"noopener\" style=\"box-sizing: border-box; background: rgb(255, 255, 255); transition: all 0.2s ease 0s; font-weight: 600; color: rgb(84, 0, 211); border-bottom: 1px solid rgba(84, 0, 211, 0.6);\">sexología</a>,&nbsp;terapia de pareja o&nbsp;<a href=\"https://psicologiaymente.com/clinica\" target=\"_blank\" rel=\"noopener\" style=\"box-sizing: border-box; background: rgb(255, 255, 255); transition: all 0.2s ease 0s; font-weight: 600; color: rgb(84, 0, 211); border-bottom: 1px solid rgba(84, 0, 211, 0.6);\">psicología clínica</a>), y seguramente haya adquirido la experiencia necesaria para poder aportar todo su conocimiento en tu beneficio.&nbsp;</p><p style=\"box-sizing: border-box; margin-top: 8px; margin-bottom: 8px; font-family: &quot;Source Sans Pro&quot;; font-size: 18px; color: rgb(89, 69, 112);\">La terapia psicológica no es contarle los problemas a un amigo o familiar,&nbsp;pues&nbsp;<span style=\"box-sizing: border-box; font-weight: 600;\">existe una base sólida</span>&nbsp;(tanto teórica como práctica)&nbsp;<span style=\"box-sizing: border-box; font-weight: 600; background-color: initial;\">avalada por la ciencia</span>.</p><h3 style=\"box-sizing: border-box; margin-top: 40px; margin-bottom: 16px; font-family: &quot;Source Sans Pro&quot;; font-size: 24px; line-height: 28px; font-weight: 600; color: rgb(47, 35, 91);\">8. Te empodera frente a la vida</h3><p style=\"box-sizing: border-box; margin-top: 8px; margin-bottom: 8px; font-family: &quot;Source Sans Pro&quot;; font-size: 18px; color: rgb(89, 69, 112);\">Uno de los objetivos de la psicoterapia es&nbsp;<span style=\"box-sizing: border-box; font-weight: 600;\">que la relación entre el terapeuta y el paciente no sea de dependencia</span>. Por tanto, el psicólogo te ayuda a ser dueño de ti mismo y a adquirir nuevas habilidades que te serán útiles en el día a día.&nbsp;</p><p style=\"box-sizing: border-box; margin-top: 8px; margin-bottom: 8px; font-family: &quot;Source Sans Pro&quot;; font-size: 18px; color: rgb(89, 69, 112);\">Asistir a terapia psicológica no es esperar que el psicólogo te solucione los problemas,&nbsp;<span style=\"box-sizing: border-box; font-weight: 600;\">es aprender a aceptar y amar lo que uno es y poner la voluntad necesaria para cambiar lo que nos causa malestar o nos impide crecer</span>.</p><h2 style=\"box-sizing: border-box; margin-top: 40px; margin-bottom: 16px; font-family: &quot;Source Sans Pro&quot;; font-size: 28px; line-height: 32px; font-weight: 600; color: rgb(47, 35, 91);\">Bonus: La terapia psicológica cambia tu cerebro</h2><p style=\"box-sizing: border-box; margin-top: 8px; margin-bottom: 8px; font-family: &quot;Source Sans Pro&quot;; font-size: 18px; color: rgb(89, 69, 112);\">Los estudios neurológicos están hallando cada vez más pruebas empíricas de la capacidad de la psicoterapia para&nbsp;<span style=\"box-sizing: border-box; font-weight: 600;\">modificar las estructuras cerebrales</span>&nbsp;y mejorarlas, consiguiendo una mejor actitud vital para afrontar el día a día.</p>','https://www.pqs.pe/sites/default/files/styles/852x479/public/2016/05/actualidad/pqs-buen-lider-tips.jpg?itok=eLFWZXwL','lifeandhealth',NULL,'es',NULL,'showme','public','no',0,1,NULL,NULL,NULL,0,'2019-07-01 22:04:21','2019-07-25 04:49:37'),(8,'Intercambio de clases de idiomas','Sabes un idioma extranjero y quieres aprender otro a cambio de una clase?','<h2 style=\"margin-bottom: 10px; line-height: 24px; font-family: DauphinPlain; font-size: 24px;\"><p style=\"color: rgb(51, 51, 51); font-family: Arial, Helvetica, Tahoma, sans-serif; font-size: 13px; line-height: 20px; margin-bottom: 0px; padding-bottom: 15px;\">Como su nombre indica las páginas de intercambio de idiomas son webs que posibilitan aprender un idioma de la mano de un hablante nativo. Dichas páginas se utiliza hoy en día como&nbsp;<strong>medio para practicar idiomas y reforzar el nivel de conversación y fluidez.</strong></p><p style=\"color: rgb(51, 51, 51); font-family: Arial, Helvetica, Tahoma, sans-serif; font-size: 13px; line-height: 20px; margin-bottom: 0px; padding-bottom: 15px;\">Afortunadamente, internet nos ofrece miles de&nbsp;<strong>opciones para practicar idiomas</strong>&nbsp;y conocer otras culturas&nbsp;<strong>sin movernos de casa gracias a los recursos de intercambio de idiomas como páginas web o apps para&nbsp;<a href=\"https://www.mosalingua.com/es/chatear-con-nativos-para-aprender-un-idioma/\" style=\"color: rgb(187, 99, 18);\">chatear con nativos</a>.</strong></p><p style=\"color: rgb(51, 51, 51); font-family: Arial, Helvetica, Tahoma, sans-serif; font-size: 13px; line-height: 20px; margin-bottom: 0px; padding-bottom: 15px;\">Una de las herramientas que suele usarse en la páginas de intercambio de idiomas es&nbsp;<strong>Skype</strong>, ya que nos permite participar en conversaciones gratuitas con alguien que &nbsp;también se encuentra aprendiendo un idioma.</p><p style=\"color: rgb(51, 51, 51); font-family: Arial, Helvetica, Tahoma, sans-serif; font-size: 13px; line-height: 20px; margin-bottom: 0px; padding-bottom: 15px;\">Es tan sencillo como lo lees. Si realmente deseas aprender un idioma,<strong>&nbsp;es necesario tener perseverancia</strong>&nbsp;para encontrar una página de intercambio de idiomas&nbsp;que se adapte a tu tiempo y a la metodología que prefieras.</p></h2><h3 style=\"color: rgb(51, 51, 51); font-family: Arial, Helvetica, Tahoma, sans-serif; font-size: 18px; font-weight: bold; line-height: normal; margin-bottom: 10px; clear: both;\">¿Qué conseguirás al usar una página de intercambio de idiomas?</h3><h2 style=\"margin-bottom: 10px; line-height: 24px; font-family: DauphinPlain; font-size: 24px;\"><p style=\"color: rgb(51, 51, 51); font-family: Arial, Helvetica, Tahoma, sans-serif; font-size: 13px; line-height: 20px; margin-bottom: 0px; padding-bottom: 15px;\">El objetivo de las&nbsp;<b>páginas web de intercambio de idiomas</b>&nbsp;que ofrecen los servicios de tandem, es el de abrir un espacio para que&nbsp;<strong>las personas puedan practicar un idioma entre ellas.</strong></p><p style=\"color: rgb(51, 51, 51); font-family: Arial, Helvetica, Tahoma, sans-serif; font-size: 13px; line-height: 20px; margin-bottom: 0px; padding-bottom: 15px;\">Por ejemplo,&nbsp;si tú hablas español y aprendes italiano, puedes encontrar en la web alguien que desee hablar contigo en italiano durante 20 o 30 minutos y &nbsp;luego pasas el mismo tiempo practicando con tu tándem para ayudarle con su español. Así de sencillo.</p><p style=\"color: rgb(51, 51, 51); font-family: Arial, Helvetica, Tahoma, sans-serif; font-size: 13px; line-height: 20px; margin-bottom: 0px; padding-bottom: 15px;\">Puedes ver esta entrada en la presentación visual de aquí abajo o puedes seguir leyendo el artículo completo.</p></h2>','https://www.ef.com.co/sitecore/__/~/media/universal/stage/5x2/pg-banner/exchange/exchange-1.jpg','sustainability',NULL,'es',NULL,'showme','public','no',0,1,NULL,NULL,NULL,0,'2019-07-01 22:05:12','2019-07-25 04:43:30'),(9,'Energía verde en Popayán','Implantación de plantas solares debido al alto nivel de luz solar que llega a los payaneses durante casi todo el año.','<h2 style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline;\"><p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: 1.125rem; line-height: 1.875rem; font-family: inherit; vertical-align: baseline; color: rgb(29, 29, 29);\">Son placas solares ligeras, flexibles, eficaces, con un nivel de transparencia y color variable, baratas, se podrían instalar en un ordenador, en un coche, dron, nave espacial o edificio, incluso en su interior. Su producción industrial está a punto de comenzar.</p></h2><h2 style=\"margin-bottom: 10px; line-height: 24px; font-family: DauphinPlain; font-size: 24px;\"><div class=\"node-teaser field field--name-field-teaser field--type-text-long field--label-hidden\" style=\"box-sizing: border-box; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Merriweather, serif; vertical-align: baseline;\"></div><div class=\"node-image field field--name-field-main-picture field--type-image field--label-hidden\" itemprop=\"image\" style=\"box-sizing: border-box; margin-top: 10px; margin-bottom: 20px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Merriweather, serif; vertical-align: baseline;\"><div class=\"ds-1col file file-image file-image-jpeg view-mode-article clearfix\" style=\"box-sizing: border-box; margin-bottom: 20px; border: 0px; font: inherit; vertical-align: baseline; overflow: hidden;\"><img src=\"https://www.elespectador.com/sites/default/files/paneles_energia_solar_0.jpg\" width=\"986\" height=\"657\" alt=\"\" style=\"box-sizing: border-box; display: block; border: 0px; font: inherit; vertical-align: baseline; height: auto; width: 650px;\"><div class=\"group-caption field-group-div caption\" style=\"box-sizing: border-box; padding: 10px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: 0.875rem; line-height: 1.3rem; font-family: inherit; vertical-align: baseline; background: rgb(29, 29, 29); color: rgb(255, 255, 255);\"><span class=\"author\" style=\"box-sizing: border-box; border: 0px; font: inherit; vertical-align: baseline;\">Pixabay</span></div></div></div><div class=\"node-body content_nota field field--name-body field--type-text-with-summary field--label-hidden\" style=\"box-sizing: border-box; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Merriweather, serif; vertical-align: baseline;\"><p style=\"box-sizing: border-box; margin-bottom: 15px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: 30px; font-family: inherit; vertical-align: baseline;\">Con sol o sombra, los muros y las ventanas de un edificio producirán la electricidad que necesita. Este sueño ecologista se ha hecho realidad en un proyecto industrial lanzado por una joven investigadora y empresaria polaca.&nbsp;</p><p style=\"box-sizing: border-box; margin-bottom: 15px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: 30px; font-family: inherit; vertical-align: baseline;\">Pocos habían oído hablar de \"la perovskita\" hasta hace apenas cinco años, pero las propiedades de este material están revolucionando el acceso a la energía solar.&nbsp;</p><p style=\"box-sizing: border-box; margin-bottom: 15px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: 30px; font-family: inherit; vertical-align: baseline;\">\"En nuestra opinión, las células solares (a base de) perovskita tienen el potencial de remediar la pobreza energética mundial\", declara a la AFP Mohammad Khaja Nazeeruddin, profesor del instituto de ciencias e ingeniería química de la Escuela Politécnica Federal de Lausana (EPFL), en Suiza, puntera en la investigación sobre energía fotovoltaica.</p><p style=\"box-sizing: border-box; margin-bottom: 15px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: 30px; font-family: inherit; vertical-align: baseline;\">Son placas solares ligeras, flexibles, eficaces, con un nivel de transparencia y color variable, baratas, se podrían instalar en un ordenador, en un coche, dron, nave espacial o edificio, incluso en su interior. Su producción industrial está a punto de comenzar.</p><p style=\"box-sizing: border-box; margin-bottom: 15px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: 30px; font-family: inherit; vertical-align: baseline;\"><span style=\"box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">- Estructura atómica</span>&nbsp;-</p><p style=\"box-sizing: border-box; margin-bottom: 15px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: 30px; font-family: inherit; vertical-align: baseline;\">En los años 1830 el alemán Gustav Rose, quien investigaba en los Urales, hizo un descubrimiento al que bautizó perovskita en honor al mineralogista ruso Lev Perovski.</p><p style=\"box-sizing: border-box; margin-bottom: 15px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: 30px; font-family: inherit; vertical-align: baseline;\">Al principio se la consideraba un mineral. Ahora designa una estructura atómica común en la naturaleza y de fácil obtención en laboratorio.</p><p style=\"box-sizing: border-box; margin-bottom: 15px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: 30px; font-family: inherit; vertical-align: baseline;\">Hubo que esperar a 2009 y a las investigaciones del japonés Tsutomu&nbsp;Miyasaka, seguido por otros, para descubrir la capacidad de las perovskitas para formar células fotovoltaicas.</p><p style=\"box-sizing: border-box; margin-bottom: 15px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: 30px; font-family: inherit; vertical-align: baseline;\">En 2013 la joven polaca Olga Malinkiewicz preparaba el doctorado en el Instituto de las Ciencias Moleculares (ICMol) de la Universidad de Valencia, en España, cuando creó una célula foltovoltaica colocando una capa de perovskitas por evaporación y luego usando la impresión por inyección.</p><p style=\"box-sizing: border-box; margin-bottom: 15px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: 30px; font-family: inherit; vertical-align: baseline;\">\"¡Fue dar en el clavo! ¡Ya no se necesitaban altas temperaturas para poner una capa fotovoltaica sobre un tipo de soporte!\", cuenta a la AFP. Un hallazgo recompensado con galardones.</p><p style=\"box-sizing: border-box; margin-bottom: 15px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: 30px; font-family: inherit; vertical-align: baseline;\"><span style=\"box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">- \"Fórmula mágica\"</span>&nbsp;-</p><p style=\"box-sizing: border-box; margin-bottom: 15px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: 30px; font-family: inherit; vertical-align: baseline;\">Dos empresarios polacos la animaron a crear con ellos la compañía Saule Technologies, nombre de la diosa pagana báltica que reina sobre el sol, la tierra y el cielo.&nbsp;</p><p style=\"box-sizing: border-box; margin-bottom: 15px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: 30px; font-family: inherit; vertical-align: baseline;\">Con el tiempo, y el apoyo del multimillonario japonés Hideo Sawada, desarrollaron laboratorios ultramodernos en los que se creó \"la fórmula mágica\" de tinta de perovskita y están construyendo un centro de producción a escala industrial.</p><p style=\"box-sizing: border-box; margin-bottom: 15px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: 30px; font-family: inherit; vertical-align: baseline;\">El gigante sueco Skanska, que ha hecho pruebas en condiciones reales en un edificio de Varsovia, acaba de firmar con Saule un contrato de explotación de esta tecnología para todos sus mercados en Europa, Estados Unidos y Canadá.</p><p style=\"box-sizing: border-box; margin-bottom: 15px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: 30px; font-family: inherit; vertical-align: baseline;\">\"La tecnología de las perovskitas nos acerca al objetivo de edificios autosuficientes en energía\", dijo a la AFP Adam Targowski, un alto cargo de Skanska.&nbsp;</p><p style=\"box-sizing: border-box; margin-bottom: 15px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: 30px; font-family: inherit; vertical-align: baseline;\">\"Las perovskitas dan resultado incluso en las superficies poco expuestas al sol\", explica.</p><p style=\"box-sizing: border-box; margin-bottom: 15px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: 30px; font-family: inherit; vertical-align: baseline;\">Una placa estándar de aproximadamente 1,3 m2 costará 50 euros (57 dólares) y su rendimiento será equiparable al de los paneles clásicos, según las estimaciones actuales.</p><p style=\"box-sizing: border-box; margin-bottom: 15px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: 30px; font-family: inherit; vertical-align: baseline;\">También se han hechos pruebas en un hotel de Japón.</p><p style=\"box-sizing: border-box; margin-bottom: 15px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: 30px; font-family: inherit; vertical-align: baseline;\">Y es que según el profesor Nazeeruddin, en tan sólo unos años, la eficacia de las perovskitas \"pasó de 3,8% a 23,7%\", un nivel comparable a los paneles de silicio.&nbsp;</p></div></h2>','https://www.tozsdeforum.hu/images/gallery_c/20161001095311_zoldenergia_kornyezetevedelem_megujulo_energia_energiahatekonysag_futes_knauf_642x369_cover.jpg','sustainability',NULL,'en',NULL,'showme','public','no',0,1,NULL,NULL,NULL,0,'2019-07-01 22:07:02','2019-07-25 03:09:31'),(10,'Sauna relajante turco','Mucha gente vive en estrés por sus trabajos, así que sería bueno una forma más de relajación.','<h1 style=\"margin-bottom: 0px; font-family: DauphinPlain; font-size: 70px; line-height: 90px; text-align: center;\"><p class=\"contenido\" style=\"box-sizing: border-box; margin-right: auto; margin-bottom: 0px; margin-left: auto; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 27px; font-family: roboto_slab_regular; font-size: 16px; vertical-align: baseline; color: rgb(57, 57, 57); -webkit-font-smoothing: antialiased; overflow-wrap: break-word; text-align: start;\"><span style=\"font-family: &quot;Open Sans&quot;;\">De acuerdo con los historiadores, las principales culturas de la antigedad (chinos, indios, egipcios, hebreos, griegos y romanos) realizaban diversos métodos de lavado y baño. Es más, tenían edificaciones separadas para estos fines.</span></p><p class=\"contenido\" style=\"box-sizing: border-box; margin-top: 40px; margin-bottom: 40px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 27px; font-family: roboto_slab_regular; font-size: 16px; vertical-align: baseline; color: rgb(57, 57, 57); -webkit-font-smoothing: antialiased; overflow-wrap: break-word; text-align: start;\"><span style=\"font-family: &quot;Open Sans&quot;;\">Por ejemplo, en Roma los baños, tanto públicos como privados, eran muy importantes. Sus principios fundamentales se basaban en calor y aire frío más calor y agua fría.</span></p><p class=\"contenido\" style=\"box-sizing: border-box; margin-top: 40px; margin-bottom: 40px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 27px; font-family: roboto_slab_regular; font-size: 16px; vertical-align: baseline; color: rgb(57, 57, 57); -webkit-font-smoothing: antialiased; overflow-wrap: break-word; text-align: start;\"><span style=\"font-family: &quot;Open Sans&quot;;\">Además, los bañistas recibían masajes y se untaban en aceite. Normalmente se requerían tres y cuatro habitaciones para el baño romano, pues contaba con varias etapas: el vestíbulo, el baño templado, el baño caliente, el baño frío, la transpiración y el lavado, masaje y untado de aceite.</span></p><p class=\"contenido\" style=\"box-sizing: border-box; margin-top: 40px; margin-bottom: 40px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 27px; font-family: roboto_slab_regular; font-size: 16px; vertical-align: baseline; color: rgb(57, 57, 57); -webkit-font-smoothing: antialiased; overflow-wrap: break-word; text-align: start;\"><span style=\"font-family: &quot;Open Sans&quot;;\">Los baños de aguas termales frecuentes en Roma también llegaron a Alemania, Francia, Bretaña y España.</span></p><p class=\"contenido\" style=\"box-sizing: border-box; margin-top: 40px; margin-bottom: 40px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 27px; font-family: roboto_slab_regular; font-size: 16px; vertical-align: baseline; color: rgb(57, 57, 57); -webkit-font-smoothing: antialiased; overflow-wrap: break-word; text-align: start;\"><span style=\"font-family: &quot;Open Sans&quot;;\">Después de las Cruzadas los baños tomaron una gran popularidad en Europa, debido a la influencia de los baños turcos.</span></p><p class=\"contenido\" style=\"box-sizing: border-box; margin-top: 40px; margin-bottom: 40px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 27px; font-family: roboto_slab_regular; font-size: 16px; vertical-align: baseline; color: rgb(57, 57, 57); -webkit-font-smoothing: antialiased; overflow-wrap: break-word; text-align: start;\"><span style=\"font-family: &quot;Open Sans&quot;;\">Igual sucedió en el siglo XIX, pero esta vez la influencia fue de los baños rusos.</span></p><p class=\"contenido\" style=\"box-sizing: border-box; margin-top: 40px; margin-bottom: 40px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 27px; font-family: roboto_slab_regular; font-size: 16px; vertical-align: baseline; color: rgb(57, 57, 57); -webkit-font-smoothing: antialiased; overflow-wrap: break-word; text-align: start;\"><span style=\"font-family: &quot;Open Sans&quot;;\">Según el informe antes mencionado, existen varias diferencias entre baños turcos, rusos, romanos y sauna, que allí llaman la sauna.</span></p><p class=\"contenido\" style=\"box-sizing: border-box; margin-top: 40px; margin-bottom: 40px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 27px; font-family: roboto_slab_regular; font-size: 16px; vertical-align: baseline; color: rgb(57, 57, 57); -webkit-font-smoothing: antialiased; overflow-wrap: break-word; text-align: start;\"><span style=\"font-family: &quot;Open Sans&quot;;\">Asegura que la principal disimilitud entre los romanos y rusos está en que los primeros trabajan con aire caliente y seco, mientras que en los segundos se mezcla aire caliente y vapor.</span></p><p class=\"contenido\" style=\"box-sizing: border-box; margin-top: 40px; margin-bottom: 40px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 27px; font-family: roboto_slab_regular; font-size: 16px; vertical-align: baseline; color: rgb(57, 57, 57); -webkit-font-smoothing: antialiased; overflow-wrap: break-word; text-align: start;\"><span style=\"font-family: &quot;Open Sans&quot;;\">En cuanto al baño turco, conocido en todo el mundo, tiene el mismo principio fundamental que el sauna: limpieza por transpiración. Sin embargo, no son lo mismo. Este tiene una atmósfera húmeda, mientras que la del sauna es seca.</span></p><p class=\"contenido\" style=\"box-sizing: border-box; margin-top: 40px; margin-bottom: 40px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 27px; font-family: roboto_slab_regular; font-size: 16px; vertical-align: baseline; color: rgb(57, 57, 57); -webkit-font-smoothing: antialiased; overflow-wrap: break-word; text-align: start;\"><span style=\"font-family: &quot;Open Sans&quot;;\">Desde hace mil o dos mil años existe el sauna en Finlandia y no hay una sola persona que no practique este tipo de baño. Es tanto el amor que sienten por ella que hay cerca de 450.000 saunas en este país.</span></p><p class=\"contenido\" style=\"box-sizing: border-box; margin-top: 40px; margin-bottom: 40px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 27px; font-family: roboto_slab_regular; font-size: 16px; vertical-align: baseline; color: rgb(57, 57, 57); -webkit-font-smoothing: antialiased; overflow-wrap: break-word; text-align: start;\"><span style=\"font-family: &quot;Open Sans&quot;;\">Para los finlandeses, al igual que para quienes toman este baño, el sauna tiene propiedades médicas y sicológicas. Según los entendidos ellos tienen mucha razón, pues la sudoración por sauna es uno de los mejores métodos para la limpieza de la piel.</span></p><p class=\"contenido\" style=\"box-sizing: border-box; margin-top: 40px; margin-bottom: 40px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 27px; font-family: roboto_slab_regular; font-size: 16px; vertical-align: baseline; color: rgb(57, 57, 57); -webkit-font-smoothing: antialiased; overflow-wrap: break-word; text-align: start;\"><span style=\"font-family: &quot;Open Sans&quot;;\">Los baños ordinarios con agua caliente y jabón no desprenden las capas muertas de la piel, ni limpian los poros tan eficazmente como un baño por transpiración.</span></p><p class=\"contenido\" style=\"box-sizing: border-box; margin-top: 40px; margin-bottom: 40px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 27px; font-family: roboto_slab_regular; font-size: 16px; vertical-align: baseline; color: rgb(57, 57, 57); -webkit-font-smoothing: antialiased; overflow-wrap: break-word; text-align: start;\"><span style=\"font-family: &quot;Open Sans&quot;;\">Además, con el sauna aumentan los promedios de la sangre caliente de la piel y de la circulación periférica. Después de esto, se duerme y descansa mejor.</span></p></h1>','https://www.republica.com/salud-y-tu/wp-content/uploads/sites/22/2016/12/sauna-beneficios.jpg','sustainability',NULL,'es',NULL,'showme','public','no',0,1,NULL,NULL,NULL,0,'2019-07-01 22:08:20','2019-07-25 04:54:11'),(11,'Clases de salsa a domicilio','Sería genial para personas o parejas que por tiempo no pueden asistir a una academia.','<h1 style=\"margin-bottom: 0px; font-family: DauphinPlain; font-size: 70px; line-height: 90px; text-align: center;\"><span style=\"color: rgb(98, 98, 98); font-family: Roboto, Arial, Tahoma, sans-serif; font-size: 14px; text-align: justify;\">Curso dirigido para todas las edades y en especial para los niños entre 4 y 10 años de edad que hacen uso del baile como medio fundamental para potencializar habilidades y cualidades para la vida, promoviendo el desarrollo motriz, social y cognitivo, con el fin de mejorar su calidad de vida.&nbsp;</span><br></h1>','https://www.atrapalo.com/common/photo/event/8/5/6/72/266446/vertic_880_0.jpg','politicsandsociety',NULL,'en',NULL,'showme','public','no',0,1,NULL,NULL,NULL,0,'2019-07-01 22:09:46','2019-07-25 04:38:53'),(12,'Primera Idea test','\'Awesome idea description...\'','<p>test de primera idea</p>','www.asakaa.com','improvethis',NULL,'es',NULL,'showme','me','no',0,74,NULL,NULL,NULL,0,'2019-07-09 13:26:01','2019-07-09 13:26:01'),(13,'Idea Yesid8','\'Awesome idea description...\'','<p>Test 1</p>','www.asakaa.com','improvethis',NULL,'en',NULL,'showme','me','no',0,73,NULL,NULL,NULL,0,'2019-07-10 02:13:21','2019-07-10 02:13:50'),(14,'cualquier cosa','\'Awesome idea description...\'','<p>otro</p>','www.sa.com','improvethis',NULL,'en',NULL,'showme','me','no',0,75,NULL,NULL,NULL,0,'2019-07-10 16:51:52','2019-07-10 16:51:52'),(15,'Aplicación transporte escolar','\'Awesome idea description...\'','<p>Crear una aplicación, donde le indique a los padres cuando va a llegar la ruta escolar para salir con el niño. Antes de eso una alarma configurable por ejemplo que suene 10 minutos antes de llegar la ruta</p>','https://guardproject.com/innova-images/15.jpg','transport',NULL,'es',NULL,'showme','public','no',0,73,NULL,NULL,NULL,0,'2019-07-27 20:52:26','2019-07-27 20:52:26'),(16,'Test reto publico','\'Awesome idea description...\'','<p>Vamos a probar innovaacion</p>','https://guardproject.com/innova-images/16.jpg','scienceandtechnology',NULL,'es',NULL,'showme','public','no',0,77,NULL,NULL,NULL,0,'2019-08-12 02:04:05','2019-08-12 02:04:05'),(17,'Test idea AG','\'Awesome idea description...\'','<p>Idea solo AG</p>','https://guardproject.com/innova-images/17.jpg','sustainability',NULL,'es',NULL,'showme','me','no',0,76,NULL,NULL,NULL,0,'2019-08-12 02:10:50','2019-08-12 02:10:50'),(18,'Idea creada para la empresa','\'Awesome idea description...\'','<p>asdasdasdasd</p>','https://guardproject.com/innova-images/18.jpg','sustainability',NULL,'es',NULL,'showme','empresarial','no',0,84,NULL,NULL,27,0,'2019-08-13 21:21:08','2019-08-13 21:21:08'),(19,'Test Yesid 2','\'Awesome idea description...\'','<p>sdsd</p>','https://guardproject.com/innova-images/19.jpg','scienceandtechnology',NULL,'es',NULL,'showme','empresarial','no',0,76,NULL,NULL,23,0,'2019-08-14 19:12:15','2019-08-14 19:12:15'),(20,'Idea para probar votacion','\'Awesome idea description...\'','<p>probando votacion....<br></p>','https://guardproject.com/innova-images/20.jpg','sustainability','idea','es',NULL,'showme','empresarial','no',0,87,0,NULL,28,0,'2019-08-16 13:35:59','2019-08-16 13:35:59'),(22,'Promocion con periodos de licencia de mas tiempo','\'Awesome idea description...\'','<p>descripcion detallada</p><table class=\"table table-bordered\"><tbody><tr><td>asdasd</td><td>dasd</td><td><br></td></tr><tr><td>asdasd</td><td>asdas</td><td>asda</td></tr><tr><td>dsad</td><td><br></td><td><br></td></tr></tbody></table><p>sas</p>','https://guardproject.com/innova-images/22.jpg','businessandconsumer','solucion','es',NULL,'showme','empresarial',NULL,0,88,21,NULL,28,0,'2019-08-16 13:41:42','2019-08-16 13:41:42'),(23,'Aumentar la caducidad de las licencias','\'Awesome idea description...\'','<p>asdasdasd</p>','https://guardproject.com/innova-images/23.jpg','sustainability','solucion','es',NULL,'showme','empresarial',NULL,0,88,21,NULL,28,0,'2019-08-16 13:46:59','2019-08-16 13:46:59'),(28,'Mascota para AG','Tener una mascota compartida','<p>Tener una mascota.<br></p>','https://guardproject.com/innova-images/28.jpg','lifeandhealth','idea','es',NULL,'showme','public','no',0,89,0,NULL,23,3,'2019-08-16 15:09:03','2019-09-13 14:28:23'),(29,'Sacar oro de partes de computadores','\'Awesome idea description...\'','<p>Sacar oro de partes de computadores<br></p>','https://guardproject.com/innova-images/29.jpg','sustainability','idea','es',NULL,'showme','me','no',0,89,0,NULL,23,0,'2019-08-16 15:22:03','2019-08-16 15:22:03'),(30,'Aplicación integrada plataformas de transporte','Aqui va la descripcion corta de la idea','<p>Crear una aplicación que centralice todas las aplicaciones de transporte, como UBER, Didi, Cabify, Beat, Picap, Etc. Donde el usuario abra una única aplicación y al pedir un carro se conecte a todas las plataformas y le de las diferentes opciones.</p><p>En el momento, el usuario tiene que abrir todas las aplicaciones para encontrar la mejor opción.</p><p>Por favor sus comentarios</p><p><br></p>','https://guardproject.com/innova-images/30.jpg','transport','idea','es',NULL,'showme','public','yes',0,76,0,NULL,23,0,'2019-08-17 17:32:09','2019-08-19 13:40:22'),(31,'Idea privada 1','\'Awesome idea description...\'','<p>Idea privada 1<br></p>','https://guardproject.com/innova-images/31.jpg','sustainability','idea','es',NULL,'showme','me','no',0,77,0,NULL,NULL,0,'2019-08-18 19:45:29','2019-08-18 19:45:29'),(32,'Idea empresa 1','\'Awesome idea description...\'','<p>Idea empresa 1<br></p>','https://guardproject.com/innova-images/32.jpg','sustainability','idea','es',NULL,'showme','empresarial','yes',0,77,0,NULL,NULL,0,'2019-08-18 19:49:19','2019-08-18 19:49:19'),(33,'Idea empresa 2','\'Awesome idea description...\'','<p>Idea empresa 1<br></p>','https://guardproject.com/innova-images/33.jpg','sustainability','idea','es',NULL,'showme','empresarial','no',0,77,0,NULL,NULL,0,'2019-08-18 19:53:01','2019-08-18 19:53:01'),(34,'Idea desde popayan','\'Awesome idea description...\'','<p>imagen desde popayan</p>','https://guardproject.com/innova-images/34.jpg','artandculture','idea','es',NULL,'showme','empresarial','no',0,77,0,NULL,NULL,0,'2019-08-18 20:17:16','2019-08-18 20:17:16'),(38,'Aplicación para surtir tiendas','Una aplicación, donde los administradores de las tiendas puedan buscar directamente al proveedor, y el proveedor ofrecer a los de las tiendas','<p>Hoy en dia los productores venden el producto a intermediarios, los intermediarios a otros mas grandes, los mas grandes venden a distribuidores y los distribuidores a las tiendas, en toda esa cadena se queda el dinero y al productor muy poco.</p><p>La idea es crear una aplicación donde se puedan inscribir las tiendas y poner los pedidos con fechas, y entre ahí quien le puede ofrecer lo que necesita, y una vez hagan el pedido ya le llega el pedido, y se va calificando para que las tiendas puedan hacerle mas pedidos de acuerdo a su calificación</p><p>Al idea es eliminar al menos dos pasos en la cadena de distribución.</p>','https://guardproject.com/innova-images/38.jpg','businessandconsumer','idea','es',NULL,'showme','public','yes',0,76,0,NULL,23,0,'2019-08-19 20:30:37','2019-08-19 20:30:37'),(39,'privada para mi empresa probando imagen','asdasdasd','<p>probando imagen solita</p>','https://guardproject.com/images/9.jpg','sustainability','idea','es',NULL,'showme','empresarial','no',0,87,0,NULL,28,0,'2019-08-20 20:56:36','2019-08-20 20:56:36'),(40,'EPS para mascotas','Se pagaría mensual una cuota bastante acsequible y las mascotas podrían gozar de un buen seguro médico.','<p>Clinica para mascotas</p><p>La gente ya no tendría que pagar esas largas cuentas cuando nuestra mascota se enferma si no que con una mensualidad bastante acsequible tendríamos asegurada la salud de nuestros animales al menos en el nivel básico a intermedio.</p><p>Cubriendo gastos como desparacitación, baños, cirugías pequeñas, juegos y demás.</p>','https://guardproject.com/innova-images/40.jpg','homeandpets','idea','es',NULL,'showme','public','no',0,87,0,NULL,28,1,'2019-08-20 21:08:26','2019-09-30 15:18:34'),(41,'Empresas de Silicon Valley lanzan propuesta para contratación de personal, ¿qué tendrías tu para ofr','Necesitamos tener una respuesta verdaderamente creativa para ¿a qué te dedicas?','<p>La forma en que dijo lo que hago dice mucho de mi trabajo, y la gente, especialmente los caza talentos no se preocupan por el puesto, tanto como por la habilidad y las experiencias, asi que debemos diferenciarnos, y esta es una oportunidad para trasmitir de forma diferente lo que hacemos, esperamos que al final tambien nos sirva para ser más creativos en las preguntas cliche que nos encontramos por ahí, que a nivel empresa podamos tener una forma divertida de sentirnos parte.&nbsp;</p><p>El reto se profundizara para encontrar la metafora que haga que Axon Group se vea y sienta diferente a las otras empresas que quieren ser competencia.&nbsp;</p><p><br></p><p><br></p><p><br></p>','https://guardproject.com/innova-images/41.jpg','businessandconsumer','idea','es',NULL,'showme','personal','yes',0,93,0,NULL,0,0,'2019-08-21 12:04:12','2019-08-21 12:04:12'),(42,'¿\"Salir de la caja\" pensando desde las 4 paredes blancas?','Me lugar de trabajo deber ser el lugar donde soy más productivo, no donde voy simplemente \"por que me toca\" todos los días','<p>Actualmente muchas empresas quieren sonar y versen con \"facebook\" o como \"Google\" en resultados, pero qué las hace diferentess, será su cultura? y que hacen para sustentar qu´r son diferentes? ¿qué hacen para promover que la gente quiera ser parte de ese algo? ¿el lugar es divertido? ¿el cliente tiene un lugar donde sinb necesidad que yo le dija el deduce: \"aqui hacen negocios grandes\"?</p><p><span style=\"font-family: &quot;Open Sans&quot;, sans-serif;\">¿\"Me siento como en casa\"? ¿es que justamente no me quiero sentir en casa?&nbsp;</span></p><p><font face=\"Open Sans, sans-serif\">Es el momento de proponer dónde quiero estar, qué puede hacer que sea más productivo (productivo es diferente de estar ocupado). ¿Este lugar me ocupa o me hace más productivo?</font></p><p><font face=\"Open Sans, sans-serif\"><br></font></p><p><font face=\"Open Sans, sans-serif\"><br></font></p><p><span style=\"font-family: &quot;Open Sans&quot;, sans-serif;\"><br></span><br></p>','https://guardproject.com/innova-images/42.jpg','sustainability','reto','es',NULL,'showme','empresarial',NULL,0,93,0,'sinlimite',23,17,'2019-08-21 14:01:15','2019-09-26 09:01:50'),(43,'Empresas de Silicon Valley lanzan propuesta para contratación de personal, ¿qué tendrías tu para ofr','Qué pasaría en mi Hoja de Vida si ofrezco mis capacidades y mis experiencias, y no el nombre de puesto? Qué pasaría en la empresa si desde lo basico se hace diferente?','<p>La forma en que dijo lo que hago dice mucho de mi trabajo, y la gente, especialmente los caza talentos, no se preocupan por el puesto, tanto como por la habilidad y las experiencias, asi que debemos diferenciarnos, y esta es una oportunidad para trasmitir de forma diferente lo que hacemos, esperamos que al final tambien nos sirva para ser más creativos en las preguntas cliche que nos encontramos por ahí, que a nivel empresa podamos tener una forma divertida de sentirnos parte.&nbsp;</p><p>El reto se profundizara para encontrar la metafora que haga que Axon Group se vea y sienta diferente a las otras empresas que quieren ser competencia.&nbsp;</p><p><br style=\"color: rgb(100, 108, 154); font-family: &quot;Open Sans&quot;, sans-serif;\"></p>','https://guardproject.com/innova-images/43.jpg','businessandconsumer','reto','es',NULL,'showme','empresarial',NULL,0,93,0,'sinlimite',23,2,'2019-08-21 14:04:03','2019-09-11 10:36:56'),(44,'nuea innovacion','asdasdasd','<p>asdasdsad</p>','https://guardproject.com/images/7.svg','sustainability','idea','es',NULL,'showme','me','no',0,87,0,NULL,28,0,'2019-08-21 15:05:39','2019-08-21 15:05:39'),(47,'Espacios de descanso','Adecuación de un espacio para recreación','<p>Disponer de un espacio donde hayan muebles comodos, actividades y juegos ludicos, como mesa de ping, juegos de mesa, que permita la integración de todos los colaboradores.</p><p>El tiempo de uso de este espacio debe ser controlado para no abusar del mismo.<br></p><p><br></p><p><br></p><p><br></p>','https://guardproject.com/innova-images/47.jpg','lifeandhealth','solucion','es',NULL,'showme','empresarial',NULL,0,108,42,NULL,23,2,'2019-08-21 17:43:28','2019-09-17 11:45:32'),(48,'Servicio online de documentación para clientes','Plataforma online de acceso a la documentación de proyectos desarrollado por Axon','<p><span style=\"font-family: &quot;Open Sans&quot;, sans-serif;\">Implementar&nbsp; un servidor web&nbsp; (BMS, otra plataforma) que contenga toda la información de los proyecto, donde el usuario pueda&nbsp; acceder a los backup, manuales, planos e información pertinente al proyecto desarrollado por axon, sin necesidad de contactar al personal de axon&nbsp;&nbsp;</span><br></p>','https://guardproject.com/images/20.svg','businessandconsumer','idea','es',NULL,'showme','public','no',0,111,0,NULL,23,0,'2019-08-21 17:43:38','2019-08-21 17:43:38'),(49,'Teletrabajo','Trabajo desde la comodidad de tu casa.','<p>La idea es dar la posibilidad a los colaboradores de trabajar desde la comodidad de la casa, ya que esto en algunos casos puede mejorar su desempeño ya que se evitan problemas como el transporte y el desarraigo familiar.</p><p>El objetivo es cambiar de ambiente de manera periodica alternando entre la oficina y la casa. <br></p><p><br></p><p><br></p><p><br></p>','https://guardproject.com/innova-images/49.jpg','sustainability','solucion','es',NULL,'showme','empresarial',NULL,0,108,42,NULL,23,14,'2019-08-21 17:52:58','2019-09-26 11:15:49'),(50,'comodidad=productividad','Brindar a los colaboradores espacios de entretenimiento','<p>Proponemos aprovechar el espacio que se encuentra detrás del area de R&amp;D, para crear una zona de confort y entretenimiento.&nbsp;</p><p>Esta zona necesitara estar cerrada para ser más agradable, adicionalmente proponemos subir la biblioteca y ampliarla, tener varios puff, música para relajarse y juegos de mesa. El suelo podría ser de pasto sintético.</p><p></p>','https://guardproject.com/innova-images/50.jpg','sustainability','solucion','es',NULL,'showme','empresarial',NULL,0,98,42,NULL,23,2,'2019-08-21 17:53:53','2019-09-18 08:16:42'),(51,'outdoor office','Adecuar las terrazas como espacio de trabajo o descanso.','<p>Crear un espacio de trabajo&nbsp; confortable en la terraza&nbsp; que tenga armonía y&nbsp; creatividad, que se pueda usar para reuniones, descanso y trabajo.</p>','https://guardproject.com/innova-images/51.jpg','artandculture','solucion','es',NULL,'showme','empresarial',NULL,0,111,42,NULL,23,1,'2019-08-21 17:59:36','2019-09-17 11:54:55'),(52,'Adecuar laboratorios de pruebas','Desarrollar un espacio adecuado y de fácil disponibilidad para realizar pruebas de productos','Tener un espacio adecuado para laboratorio de pruebas que posea mesones, puntos eléctricos de fácil acceso adecuarlo como un laboratorio de universidad, rack para diferentes IED y que estos se pueda acceder fácilmente','https://guardproject.com/innova-images/52.jpg','sustainability','solucion','es',NULL,'showme','empresarial',NULL,0,111,42,NULL,23,2,'2019-08-21 18:07:50','2019-09-17 11:54:54'),(53,'Cambio de nombre área','Percepción interna','<p><br></p><p><span style=\"font-family: &quot;Open Sans&quot;, sans-serif;\">-Los dealers de las soluciones</span></p><p><span style=\"font-family: &quot;Open Sans&quot;, sans-serif;\">-The Friendly solutions (FS)</span></p><p><span style=\"font-family: &quot;Open Sans&quot;, sans-serif;\"><br></span><br></p>','https://guardproject.com/innova-images/53.jpg','sustainability','solucion','es',NULL,'showme','empresarial',NULL,0,116,43,NULL,23,0,'2019-08-21 18:07:54','2019-08-21 18:07:54'),(54,'Evitó que el mundo quede tinieblas','Mi trabajo consiste en garantizar que no falte energía eléctrica en nuestro mundo','<p>Ingeniero de proyectos a ingeniero de soluciones energéticas (reparador de instalaciones navideñas), soy megavatio de potencia activa, un multimetro calibrado, soy aprendiz de cuerda floja en alta tensión en linea viva.&nbsp;<br></p><p><br></p><p><br></p><p><br></p><p>Desarrollador a soy artesanos de bit y los convierto en diamantes, soy cirujano computacional.&nbsp;</p><p><br></p><p>Tester a catador de bits, cazador de bugs, cazar, la mano que te ayuda 24/7, el que saca de&nbsp; apuros.</p>','https://guardproject.com/innova-images/54.jpg','artandculture','solucion','es',NULL,'showme','empresarial',NULL,0,123,43,NULL,23,0,'2019-08-21 18:08:10','2019-08-21 18:08:10'),(55,'Ambiente didáctico en capacitaciones','Crear  un entorno  con juegos didácticos para los cursos capacitaciones.','<p>1. Buscar juegos, maquetas, instrumentos con que se puedan realizar analogías de los temarios dictados,&nbsp; relacionados con prácticas para aprender a través de estos juegos, con lo cual el cliente vea una dinámica diferente de aprendizaje y que el personal de Axon también puedan interactuar con los clientes para crear conexiones de amistad.</p><p>2. Ambiente: deber ser un espacio grande, por ejemplo toda la terraza del ultimo piso de Axon. Que este tenga todos elementos que permitan desarrollar las actividades.</p><p>3. Ejemplos de juegos: que la persona sea un relé, que tenga que mandar un bola por un canaleta, que deba llegar al destino. Hay multiples canaletas que se cruzan pero no se general colisión, que la persona tenga un mecanismo con resorte, que genere impulso para la bola. otro ejemplo que haya time out, que la bola deba llegar antes que finalice el tiempo y ......Que sea divertido.</p><p>4. Haya otros juegos con los cuales el personal de ventas pueda jugar con los clientes para crear conexiones de amistad.</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;------------------------------------------- VENDER EXPERIENCIA-----------------------------------------------------</p><p><br></p>','https://guardproject.com/innova-images/55.jpg','businessandconsumer','solucion','es',NULL,'showme','empresarial',NULL,0,112,42,NULL,23,0,'2019-08-21 18:10:14','2019-08-28 08:12:57'),(56,'Decoración homogenea','Homogeneidad en espacio de  trabajo','Toda la oficina debe contar con un tipo de decoración que sea homogénea en todos los pisos, por ejemplo, posters con imágenes de tecnología.','https://guardproject.com/innova-images/56.jpg','sustainability','solucion','es',NULL,'showme','empresarial',NULL,0,111,42,NULL,23,0,'2019-08-21 18:28:53','2019-08-21 18:28:53'),(57,'Espacios agradables','Un ambiente cómodo y agradable para dejar fluir nuestras ideas','<p>&nbsp;- Necesitamos un lugar para libernarnos, soltar el cuerpo, sentirnos libres e ilimitados. aprovechar los espacios en las terrazas, habilitarlas con carpas,&nbsp; con muebles y pufs, hamacas y zona de entretenimiento y descanso, la <font face=\"Open Sans, sans-serif\">&nbsp;terraza del ultimo piso para ejercitarnos (caminadora, caminadora con escaleras, pesas, bicicleta estática) y meditar (espacio para YOGA). con entrenadores</font></p><p><font face=\"Open Sans, sans-serif\">- Remodelar la cocina como una cafeteria, quitar el mezón y poner mesas y sillas.</font></p><p><span style=\"font-family: &quot;Open Sans&quot;, sans-serif;\">-Acondicionar las oficinas con paredes de colores e imagenes creativas</span><br></p><p><font face=\"Open Sans, sans-serif\">-Colocar un baño aislado para sentirse relajado, no observado ni señalado</font></p><p><font face=\"Open Sans, sans-serif\">-Patinetas electricas para movilizarse a los alrededores</font></p>','https://guardproject.com/innova-images/57.jpg','sustainability','solucion','es',NULL,'showme','empresarial',NULL,0,116,42,NULL,23,0,'2019-08-21 18:30:22','2019-08-21 18:51:00'),(58,'Naming de nuestros equipos de trabajo','Buscar nombres creativos y diferentes que represente las actividades de nuestros equipos de trabajo','<p style=\"font-family: &quot;Open Sans&quot;, sans-serif;\">Compañeritos Axon,</p><p style=\"font-family: &quot;Open Sans&quot;, sans-serif;\">Hemos creado una propuesta para cambiar los nombres de nuestras áreas de trabajo, que puedan ser más llamativas, diferentes y representen nuestros roles. Los invitamos a buscar en la imagen el nombre de su área de trabajo y comentarnos si se sienten identificados.<br></p><p style=\"font-family: &quot;Open Sans&quot;, sans-serif;\">Ismael, Edison y Alejandra<br></p><p style=\"font-family: &quot;Open Sans&quot;, sans-serif;\"><br></p><p style=\"font-family: &quot;Open Sans&quot;, sans-serif;\"><img src=\"data:image/png;base64,\" data-filename=\"Team Axon Group.png\" style=\"width: 1003.33px;\"><br></p><p style=\"font-family: &quot;Open Sans&quot;, sans-serif;\"><br></p><p style=\"font-family: &quot;Open Sans&quot;, sans-serif;\"><br></p>','https://guardproject.com/innova-images/58.jpg','sustainability','solucion','es',NULL,'showme','me',NULL,0,117,43,NULL,23,1,'2019-08-21 20:17:03','2019-09-11 10:36:36'),(60,'Establecer el nuevo estandar en IHMs y SCADAs','El equipo Axon establece el nuevo estandar en IHMs y SCADAs','<p>Queremos marcar la pauta en lo que un SCADA debería ser/hacer, nosotros vamos ha establecer el nuevo ESTANDAR en el sector.&nbsp;</p><p>¿Cuales son las nuevas funciones/caracteriticas que haría que ABB o SIEMENS dejen de usar el suyo y lo remplacen por nuestro desarrollo? </p><p><span style=\"font-family: &quot;Open Sans&quot;, sans-serif;\"><b>Algunos Ejemplos para Imaginar.</b> El nuevo Axon Builder vienen con __________, por lo cual mañana mismo Siemens o ABB desean firmar convenio para migrar a Axon Builder.&nbsp;&nbsp;</span><br></p><p>Un servicio de la industria 4.0 debería tener dentro de sus caracteristicas __________________</p><p>Nadie ha pensado en esto, por lo que los nuevos SCADAs deberían venir con _________________</p><p>Gracias a estas funcionalidades: 1.&nbsp; _______________ </p><p>2. _____________________, 3. _________________, <b>Axon Group se establece como la empresa de mayor crecimiento en el sector!!!!.&nbsp;</b></p><p><br></p>','https://guardproject.com/innova-images/60.jpg','scienceandtechnology','reto','es',NULL,'showme','empresarial',NULL,0,93,0,'sinlimite',23,61,'2019-08-22 14:39:29','2019-10-01 09:58:51'),(61,'Nombre Axon Builder','Propuesta Axon Builder','<p>Nombrar a la nueva versión de Axon Builder, Axon Builder 4.0. Haciendo mas referencia a Industria 4.0, o Colombia 4.0&nbsp;<font face=\"Open Sans, sans-serif\">https://www.col40.co/638/w3-channel.html</font></p>','https://guardproject.com/innova-images/61.jpg','13Axon Builder','solucion','es',NULL,'showme','empresarial',NULL,0,76,60,NULL,23,1,'2019-08-22 16:09:44','2019-09-13 18:17:54'),(63,'HMI Configuracion Automatica','Hacer la configuración automática de la HMI a partir del SSL','<p>A partir de la configuración IEC 61850 SSL que entrega la configuración de los reles, inicialmente con SIEMENS DIGSI 5 que hace el diagrama unifilar, poder hacer la HMI de forma automática, es decir poder pasar a pruebas FAT de manera instantánea.</p><p>Se reduce el tiempo de configuracion de una HMI de mas o menos de 15 dias a 10 minutos</p><p><b>Esta idea se ha planteado ya desde hace tiempo para hacerla pero lo que queremos ahora es primero validar con todo Axon Group y como segundo pasa pasar a preguntar a los clientes antes de pasar a implementación.</b></p>','https://guardproject.com/innova-images/63.jpg','13Axon Builder','solucion','es',NULL,'showme','empresarial',NULL,0,76,60,NULL,23,3,'2019-08-23 06:24:50','2019-09-17 11:09:22'),(64,'Realidad Aumentada en Subestaciones Electricas','Crear un prototipo tecnologico basado en Realidad Aumentada aplicado en el ambito Automatizacion y control','<p><span class=\"ILfuVd\"><span class=\"e24Kjd\"><b>Segun el concepto</b></span></span></p><p><span class=\"ILfuVd\"><span class=\"e24Kjd\"><b>Realidad Aumentada</b>: el mundo real con otros ojos. La <b>Realidad Aumentada</b> (RA) es una tecnología que permite superponer elementos virtuales sobre nuestra visión de la <b>realidad</b>.</span></span></p><p><span class=\"ILfuVd\"><span class=\"e24Kjd\"><b>Idea</b><br></span></span></p><p><span class=\"ILfuVd\"><span class=\"e24Kjd\">La idea es aplicar esta tecnologia asociando la informacion brindada por Axon Exchange y mostrarla a los usuarios en tiempo real frente a una linea o un gabinete que este gestionando</span></span></p><p><span class=\"ILfuVd\"><span class=\"e24Kjd\"><b>Beneficios</b></span></span></p><p><span class=\"ILfuVd\"><span class=\"e24Kjd\">- Tener proyectos para mostrar en eventos como la FISE y que ponen a la organizacion en la vanguardia tecnologica</span></span></p><p><span class=\"ILfuVd\"><span class=\"e24Kjd\">- Nuevos productos en estado de prototipo para evaluar por los clientes</span></span></p><p><span class=\"ILfuVd\"><span class=\"e24Kjd\">-&nbsp; Fomentar el posicionamiento de marca de Axon Group como organizacion vinculada a la investigacion e implementacion de nuevas tendencias en tecnologia <b><br></b><br></span></span></p><p><span class=\"ILfuVd\"><span class=\"e24Kjd\"><br></span></span></p><p><span class=\"ILfuVd\"><span class=\"e24Kjd\"><br></span></span></p>','https://guardproject.com/images/19.svg','scienceandtechnology','idea','es',NULL,'showme','empresarial','yes',0,121,0,NULL,23,0,'2019-08-23 16:16:08','2019-08-23 16:16:08'),(65,'Generar contenidos en plataforma UDEMY','Generar contenidos que puedan venderse online (Protocolos) y publicar en la plataforma UDEMY','<p><b>Concepto</b></p><p><span>Udemy.com es una plataforma de aprendizaje en línea. Está dirigido\n para adultos profesionales.​ A diferencia de los programas académicos \nMOOC conducidos por tradicionales cursos de trabajo creados por el \ncolegio, Udemy utiliza contenido de creadores en línea para vender y así\n conseguir ganancias.​</span></p><p><b><span>Idea</span></b></p><p><span>Generar contenidos que puedan venderse online (Protocolos) y publicar en la plataforma UDEMY para traducir en multiples idiomas</span></p><p><b><span>Beneficios</span></b></p><p><span>- Obtener ganancias con los cursos vendidos</span></p><p><span>- Promocionar los productos de Axon Group</span></p><p><span>- Posicionar Axon Group como una entidad de capacitacion en una plataforma como UDEMY a nivel mundial </span><b><span><br></span></b></p><p><span><br></span></p><p><span><br></span></p>','https://guardproject.com/innova-images/65.jpg','sustainability','idea','es',NULL,'showme','empresarial','yes',0,121,0,NULL,23,0,'2019-08-23 16:22:29','2019-08-23 16:22:29'),(66,'\"Contar con espacios más lúdicos y menos funcionales\"','QUE LLUEVAN IDEAS Y QUE SE VAYA LA pereza','<p>&nbsp;\"<span style=\"color: rgb(95, 95, 95); font-family: &quot;Roboto Condensed&quot;, sans-serif, Arial, Helvetica, sans-serif; font-size: 14px; text-align: justify;\">El ambiente de trabajo es muy importante y se ve reflejado en el desempeño. Según el profesor Haslam, los efectos psicológicos que causan oficinas diseñadas amigablemente aumentan en 17% la productividad, en comparación con las oficinas usuales netamente funcionales.&nbsp;</span><span style=\"color: rgb(95, 95, 95); font-family: &quot;Roboto Condensed&quot;, sans-serif, Arial, Helvetica, sans-serif; font-size: 14px; text-align: justify;\">Contar con espacios más lúdicos y menos funcionales, incrementan la satisfacción de los trabajadores, influyen en su iniciativa y por supuesto mejoran su desempeño\"</span></p><p><b>Porque no pensar en unas oficinas llenas de color, con escritorios de formas, piso \"no triste\", plantas alrededor etc. Menos cubículos, más hamacas.&nbsp; Un ejemplo es la de la imagen.&nbsp;</b></p><p><img src=\"data:image/jpeg;base64,\" data-filename=\"New-Office-Picture-3.jpg\" style=\"width: 600px;\"></p><p><b>Y si las reuniones con los clientes son así?&nbsp;</b></p><p><img src=\"data:image/jpeg;base64,\" data-filename=\"oficinas-google-1.jpg\" style=\"width: 700px;\"></p><p><b>Seguramente van a querer volver y hacer muchos negocios con nosotros.&nbsp;</b></p>','https://guardproject.com/innova-images/66.jpg','sustainability','solucion','es',NULL,'showme','empresarial',NULL,0,86,42,NULL,23,2,'2019-08-23 16:22:54','2019-09-18 08:23:55'),(67,'Desplegar los productos Axon Group en Universidades','Desplegar las versiones de los productos en los diferentes ambitos estudiantiles','<p><b>Concepto</b></p><p>Axon Group cuenta en la actualidad con diferentes productos funcionales en versiones demo.</p><p><b>Idea</b></p><p>Estos productos&nbsp; puedan ser desplegados en las universidades con el objetivo de \naprovechar los semilleros de investigacion y laboratorios de \nuniversidades.</p><p><b>Beneficios</b></p><p>- Retroalimentacion por usuarios al usar la herramienta</p><p>- Reconocimiento de las universidades como entidad que apoya la educacion</p><p>- Imponer una marca industrial en la educacion familiarizando a los estudiantes con nuestros productos<b><br></b><br></p><p><br></p>','https://guardproject.com/innova-images/67.jpg','sustainability','idea','es',NULL,'showme','empresarial','yes',0,121,0,NULL,23,1,'2019-08-23 16:33:09','2019-09-11 10:51:20'),(68,'asdasd','asdasdasd','<p>asdasd</p>','https://guardproject.com/images/23.svg','sustainability','idea','es',NULL,'showme','empresarial','no',0,128,0,NULL,30,0,'2019-08-23 17:20:24','2019-08-23 17:20:24'),(69,'asdasd','asdasd','<p>asdasd</p>','https://guardproject.com/images/4.svg','sustainability','idea','es',NULL,'showme','empresarial','no',0,128,0,NULL,30,0,'2019-08-23 17:20:30','2019-08-23 17:20:30'),(70,'asdasd','asdasd','<p>asdasd</p>','https://guardproject.com/images/13.jpg','sustainability','idea','es',NULL,'showme','empresarial','no',0,128,0,NULL,30,0,'2019-08-23 17:20:37','2019-08-23 17:20:37'),(71,'asdasd','asdasd','<p>asdasdasd</p>','https://guardproject.com/images/3.svg','sustainability','idea','es',NULL,'showme','empresarial','no',0,128,0,NULL,30,0,'2019-08-23 17:20:44','2019-08-23 17:20:44'),(72,'asdasd','asdasd','<p>asdasd</p>','https://guardproject.com/images/15.svg','sustainability','idea','es',NULL,'showme','empresarial','no',0,128,0,NULL,30,0,'2019-08-23 17:20:51','2019-08-23 17:20:51'),(73,'asdasd','asdasdasd','<p>asdasdasd</p>','https://guardproject.com/images/24.svg','sustainability','idea','es',NULL,'showme','empresarial','no',0,128,0,NULL,30,0,'2019-08-23 17:20:58','2019-08-23 17:20:58'),(74,'asdasda','asdasd','<p>asdasdasd</p>','https://guardproject.com/images/22.svg','sustainability','idea','es',NULL,'showme','empresarial','no',0,128,0,NULL,30,0,'2019-08-23 17:21:34','2019-08-23 17:21:34'),(75,'asass','asaasa','<p>asdasd</p>','https://guardproject.com/images/23.svg','sustainability','idea','es',NULL,'showme','empresarial','no',0,128,0,NULL,30,0,'2019-08-23 17:22:00','2019-08-23 17:22:00'),(76,'asdasdasd','asdasd','<p>asdasdasdasd</p>','https://guardproject.com/images/20.svg','sustainability','idea','es',NULL,'showme','empresarial','no',0,128,0,NULL,30,0,'2019-08-23 17:22:10','2019-08-23 17:22:10'),(77,'ssdas','dasdasda','<p>asdasdasd</p>','https://guardproject.com/images/1.svg','sustainability','reto','es',NULL,'showme','empresarial',NULL,0,128,0,'sinlimite',30,0,'2019-08-23 17:22:49','2019-08-23 17:22:49'),(78,'asdasd','asdasdasd','<p>asdasdasda</p>','https://guardproject.com/images/20.svg','sustainability','reto','es',NULL,'showme','empresarial',NULL,0,128,0,'sinlimite',30,0,'2019-08-23 17:22:56','2019-08-23 17:22:56'),(79,'asdasdasd','asdasdasd','<p>asasdasdasd</p>','https://guardproject.com/images/23.svg','sustainability','reto','es',NULL,'showme','empresarial',NULL,0,128,0,'sinlimite',30,0,'2019-08-23 17:23:02','2019-08-23 17:23:02'),(80,'asdasd','asdasdasdasd','<p>asdasdasdasd</p>','https://guardproject.com/images/12.svg','sustainability','reto','es',NULL,'showme','empresarial',NULL,0,128,0,'sinlimite',30,0,'2019-08-23 17:23:08','2019-08-23 17:23:08'),(81,'asdasdasd','asdasdasd','<p>asdasdasdasd</p>','https://guardproject.com/images/10.jpg','sustainability','reto','es',NULL,'showme','empresarial',NULL,0,128,0,'sinlimite',30,0,'2019-08-23 17:23:18','2019-08-23 17:23:18'),(82,'asdasdasasd','asdasdasd','<p>asdasdasdasd</p>','https://guardproject.com/images/26.svg','sustainability','reto','es',NULL,'showme','empresarial',NULL,0,128,0,'sinlimite',30,0,'2019-08-23 17:23:26','2019-08-23 17:23:26'),(83,'asdasd','asdas','<p>asdasd</p>','https://guardproject.com/images/21.svg','sustainability','solucion','es',NULL,'showme','empresarial',NULL,0,128,82,NULL,30,0,'2019-08-23 17:24:45','2019-08-23 17:24:45'),(84,'asdasd','asdasd','<p>asdasda</p>','https://guardproject.com/images/16.svg','sustainability','solucion','es',NULL,'showme','empresarial',NULL,0,128,82,NULL,30,0,'2019-08-23 17:24:50','2019-08-23 17:24:50'),(85,'asdasd','asdasd','<p>asdasdasd</p>','https://guardproject.com/images/20.svg','sustainability','solucion','es',NULL,'showme','empresarial',NULL,0,128,82,NULL,30,0,'2019-08-23 17:24:56','2019-08-23 17:24:56'),(86,'asdasd','asdasd','<p>asdasdasd</p>','https://guardproject.com/images/7.svg','sustainability','solucion','es',NULL,'showme','empresarial',NULL,0,128,82,NULL,30,0,'2019-08-23 17:25:04','2019-08-23 17:25:04'),(87,'iProject App','Aplicacion movil Asistente en la ejecución de proyectos de ingeniería Axon','<p>Aplicación móvil asistente en la ejecución de proyectos de ingeniería, ya que no solo va a mostrar el paso a paso con una metodología estandarizada,&nbsp; sino que va a mostrar el estado actual del mismo.&nbsp; Esta aplicación también tendrá la función de comunicarse con un especialista en el tema, para que colabore en actividades donde el ingeniero no tenga conocimiento. También tendrá un listado de soluciones comunes a problemas comunes, donde se podrá comentar y alimentar el contenido a medida que aumente su utilización.</p>','https://guardproject.com/innova-images/87.jpg','scienceandtechnology','idea','es',NULL,'showme','empresarial','yes',0,106,0,NULL,23,1,'2019-08-23 17:25:30','2019-09-26 09:04:04'),(89,'Alarmas inteligentes','Desarrollar un panel de alarmas inteligentes','<p>En la actualidad cuando ocurre un disparo, se presentan muchas alarmas, y cuando es un disparo general de una subestación de mas o menos 10 bahías de 115kV, se pueden presentar hasta unas 500 señales a la vez, lo que se hace que sea demasiado complicado saber porque fue el disparo</p><p>La idea es hacer un análisis de alarmas, y mostrar en un panel de alarmas inteligentes a mucho diez alarmas, donde se muestre porque se origino el disparo, cual interruptor disparo primero y cuales disparos siguieron, algo que le permita al operador saber porque fue el disparo de manera instantánea</p><p>Tambien poder analizar el disparo, es decir poder dar clic derecho y ver los comtrade</p>','https://guardproject.com/storage/1566783976.PNG','13Axon Builder','solucion','es',NULL,'showme','empresarial','no',0,76,60,NULL,23,2,'2019-08-25 20:46:16','2019-09-11 09:06:45'),(90,'Estadísticas paneles','Mímicos con estadísticas graficas','<p>Como la HMI, prácticamente esta sin uso en la subestación, lo que se necesita es dar un valor agregado a lo existente.</p><p>Para esto es necesario no solo mostrar unifilares, alarmas tendencias y mandos.</p><p>La idea es dar estadísticas gráficas, de:</p><ul><li>Que lineas se disparan mas</li><li>Cuales son las funciones de protección que mas generan disparos (porque dispara el INT)</li><li>Cuanta energía se pierde por los disparos</li><li>A que horas ocurren mas frecuentemente los disparos</li><li>Cuando tiempo demora normalmente en restablecer el servicio</li></ul><p>Todo esto representado de forma grafica y que se pueda generar un reporte en PDF</p><p><br></p>','https://guardproject.com/storage/1566784651.PNG','13Axon Builder','solucion','es',NULL,'showme','empresarial','no',0,76,60,NULL,23,4,'2019-08-25 20:57:31','2019-09-23 15:32:50'),(94,'Listado de señales integrado a Scada','Poder sincronizar el listado de señales con el Scada','<p>Para sacar el listado de señales, y en 61850 buscar los nodos logicos e ir haciendo la configuración, es donde se va la mayor cantidad de tiempo en la configuración de la HMI.</p><p>Como se hace en la actualidad es que el listado de señales se hace en Excel y luego se pasa a configurar el HMI</p><p>La idea es que el scada tenga como un Excel integrado donde se realice el listado de señales, y ese mismo se sincronice con la configuración de la HMI, o si el HMI tiene Slave para envío a centro de control, que este listado este sincronizado con el mapeo de señales.</p>','https://guardproject.com/storage/1566786412.PNG','13Axon Builder','solucion','es',NULL,'showme','empresarial','no',0,76,60,NULL,23,1,'2019-08-25 21:26:52','2019-09-17 11:01:11'),(95,'Registro de mantenimiento equipos','Herramienta para el control de mantenimiento en las subestaciones','<p>En la actualidad se dañan los computadores, o cualquier equipo, y en unos dias después se daña por lo mismo y nadie sabe que eso mismo ya había pasado, y cual fue la solución.</p><p>La solución: Desarrollar sobre el scada, una forma de adicionar notas de mantenimiento, por ejemplo, se daño un Switch, poder dejar la nota de que le paso y que se hizo, lo mismo para cualquier interruptor o equipo, con eso se lleva registro o como una bitácora para solucionar problemas posteriores con mas facilidad.</p><p><br style=\"font-family: &quot;Open Sans&quot;, sans-serif;\"></p>','https://guardproject.com/storage/1566820799.PNG','13Axon Builder','solucion','es',NULL,'showme','empresarial','no',0,76,60,NULL,23,0,'2019-08-26 06:59:59','2019-09-06 18:24:42'),(96,'Axon Builder Cloud','Subir los datos mas importantes a la nube para mostrar reportes a las diferentes areas','<p>En el momento las HMIs locales tienen muchos datos, que no son utilizados porque las HMIs casi nadie las utiliza, son subestaciones desatendidas.</p><p>La HMI podría subir los datos a la nube, y desde ahí hacer un análisis de los datos para mostrarlos a las diferentes áreas, como por ejemplo datos de disparos por protecciones al área de protecciones, datos semanales de energías a las gerencias, datos de la red al área de comunicaciones...&nbsp;</p><p>La vista seria desde navegadores web, PC o Movil</p><p>Esto todo se realiza desde un servidor web con diferentes perfiles.</p><p>Y se da la posibilidad de pasar a cobrar mensualidad, y no cobro único como esta actualmente</p>','https://guardproject.com/storage/1566825475.png','13Axon Builder','solucion','es',NULL,'showme','empresarial','no',0,76,60,NULL,23,2,'2019-08-26 08:17:55','2019-09-17 11:00:05'),(97,'Integración protecciones a Scada','Integrar y analizar el sistema de protección en el Scada','<p>Ahora con IEC 61850, y los comtrade se puede tener muchos datos de protección, por lo que se puede hacer mas integración de control con Protección,</p><p>Por ejemplo mostrar histórico de cambios de parámetros de protección, mostrar parámetros actuales, fechas de cambios, escribir parámetros al rele, sin necesidad del software.</p><p>Backups automáticos de configuracion, análisis de disparos.</p><p>Ver y analizar comtrade</p>','https://guardproject.com/storage/1566827199.jpg','13Axon Builder','solucion','es',NULL,'showme','empresarial','no',0,76,60,NULL,23,2,'2019-08-26 08:46:39','2019-09-17 11:08:22'),(98,'Diagnostico comunicaciones','Axon Builder haga un diagnostico de estado de las comunicaciones','<p>Dado que las HMIs tienen poco uso, es necesario ponerlas a trabajar para el diagnostico de las comunicaciones.</p><p>Ejemplo estado de GOOSE, perdidas de datos, poder ver nodos 61850, estatus de señales, etc</p><p>Es decir hacer un Station Scout, dentro del Scada, con eso sería de mucha facilidad para el personal de mantenimiento, y es una buena herramienta para que el personal de subestaciones lo pida que se instale en todas las subesatciones</p>','https://guardproject.com/storage/1566839421.PNG','13Axon Builder','solucion','es',NULL,'showme','empresarial','no',0,76,60,NULL,23,2,'2019-08-26 12:10:21','2019-09-17 11:02:27'),(99,'Simulación Subestaciones','Axon Builder como herramienta de simulación de subestación para pruebas','<p>Para darle mas utilidad al Scada, tener un modulo de simulación de subestaciones, aprovechando por ejemplo las funciones de Test de IEC 61850, donde se podría probar IEDs en modo test hacia los reles, sin ejecutar disparos relaes.</p><p>También realizar pruebas automáticas de sistemas de control de subestaciones, incluyendo pruebas de enclavamientos de forma automática</p><p>Y adelantarse con los Sample Values, donde se necesita hacer inyecciones a los reles por Software</p>','https://guardproject.com/storage/1566840013.png','13Axon Builder','solucion','es',NULL,'showme','empresarial','no',0,76,60,NULL,23,1,'2019-08-26 12:20:13','2019-09-18 12:26:08'),(104,'SCADA con inteligencia Artificial','Inteligencia Artificial para la industria, y las Subestaciones Eléctricas','<p>Creo que debería ir un poco mas allá el SCADA con el tema de decisiones sencillas, vendidas bajo el nombre de inteligencia artificial. acciones como </p><p>- Descargar un COMTRADE automáticamente luego de que llegue la señal de disparo de un relé. </p><p>- si tengo una carga mas alta de lo habitual (histórico) me advierta, </p><p>- que me alarme previo al relé que se están alcanzando valores cercanos a los ajustes de protecciones. </p><p>- que tenga la opción de energizar una linea automáticamente. o que evalué previo a la energización que condiciones no se están cumpliendo.</p><p>- Por ejemplo en el tema de generadores son muchos pasos, y muchas revisiones entre cada paso para realizar la energizacion. la posibilidad de que el SCADA supervise, validé, Ejecute y tome decisiones creo que al igual que en los autos con inteligencia artificial daría la sensación de ir un paso adelante de los demás</p><p>- y si se suma las redes de comunicación, puede incluso enviar información pertinente a usuarios autorizados que lleven nuestra APP. o analisis de fallas a segundos de haber ocurrido.&nbsp;</p><p> </p><p>De hecho para la parte de implementacion también aplica si se crea un estándar en la forma de mapear señales, el SCADA me genere automáticamente la pantalla con mandos, medidas, supervision de estados y alarmas. que el trabajo de integrar una nueva bahía se resuma a validar y hacer retoques, va a permitir optimizar y dar la oportunidad a mejoras<br></p>','https://guardproject.com/storage/1566915068.jpg','sustainability','solucion','es',NULL,'showme','empresarial','no',0,101,60,NULL,23,3,'2019-08-27 09:11:08','2019-10-01 09:58:39'),(105,'Núcleo inteligente','Núcleo inteligente centralizado, que una las diversas tecnologías y cambie la forma de operación del sistema eléctrico.','<p style=\"font-family: &quot;Open Sans&quot;, sans-serif;\">La tendencia de las protecciones es desaparecer, con la llegada de la subestaciones digitales, donde los relés pierden sus entradas digitales, corriente y voltaje, se van a volver unas tabletas táctiles, computadores, ya no será necesario que sean así de grandes, luego se unirán en un solo computador o dos, todas las protecciones, que gestionen todo, se reducirá los cárcamos, las casetas, los tableros, que sentido tienen que los tableros sean así de grandes, cuando ya no se necesita el cableado, donde ya no haya relés?</p><p style=\"font-family: &quot;Open Sans&quot;, sans-serif;\">Una idea también es trabajar en esos dos servidores que tengan todas las funciones de protección y eliminar relés, es posible que en los siguiente años haya una inflexión de la tecnología que avance mas, que elimine las barreras (ejemplo redundancia prp, antes no existía, antes ing de protecciones quería todo cableado, ahora ya no, ahora confían y envían muchas señales por Goose) la tecnología puede cambiar tanto, que se eliminarán los reles y quedarán los dos servidores manejando todo.</p><p style=\"font-family: &quot;Open Sans&quot;, sans-serif;\">Si vamos un poco mas allá, hay varias tecnologías por separado, están los temas de ciberseguridad, al producto BMS de Axon, esta la necesidad de unirle ciberseguridad, esta el producto de captura de archivos comtrade (un cliente dijo: sería bueno que el producto tome del archivo comtrade el tiempo de apertura de cada interruptor, lo analice y así le avise que esta a punto de fallarle la bobina,&nbsp;<span style=\"font-weight: bolder; color: rgb(0, 0, 255);\">esto seria predecir una falla grave)&nbsp;</span><span style=\"font-weight: bolder;\">,&nbsp;</span>también esta tecnologías de sicronfasores, cambio de grupos protecciones en reconectadores, el tema de smart grid y muchos con los cuales se podría hacer un solo sistema, que una y use toda esa tecnología e información, hay mucha información con la cual se podría desarrollar un sistema inteligente, que tome decisiones y actúe por si solo. Hay mucha información para que una red neuronal o sistema similar aprenda.</p><p style=\"font-family: &quot;Open Sans&quot;, sans-serif;\">Que vuelva la vida mas simple a los clientes y usuarios. El sistema o núcleo permita, desplegar información como yo usuario la quiera ver y tener, donde quiera estar, no necesariamente estando frente a un computador. En conferencias, exponen que los vidrios de la casas serán monitores para los doctores, que estos operarán a distancia y se podrán comunicar con otros por esos espejos o vidrios.</p><p style=\"font-family: &quot;Open Sans&quot;, sans-serif;\">Si es verdad como va avanzar la tecnología y la inteligencia artificial, si van haber jueces que den setencias, entro otros ejemplos, en nuestro rubro, los operadores desaparecerán, la tendencia es que será un sistema inteligente que realice todo, es mas pueda que ya no sea necesario los paneles de alarmas e interfaces.</p><p style=\"font-family: &quot;Open Sans&quot;, sans-serif;\">Le podemos poner un nombre, así como en las películas.</p><p style=\"font-family: &quot;Open Sans&quot;, sans-serif;\">En EXMA, cuando expuso el fundador de Netflix, el de waze, entre otros, su éxito del producto no fue de la noche a la mañana, fueron varios años para conseguirlo y en ese entonces no existía la tecnología, recuerden Netflix inventaba su negocio cuando no habia la tecnología para lo que hoy se hace y waze inició en 2006, en ese año recuerdo que eran esos celulares nokia.</p>','https://guardproject.com/storage/1567003461.jpg','scienceandtechnology','idea','es',NULL,'showme','empresarial','no',0,112,0,NULL,23,0,'2019-08-28 09:44:21','2019-08-28 09:44:21'),(106,'Scada a la mano','Tener el Builder en una APP','<p>Utilizar una APP que cumpla la funcionalidad de APP IHM con una interfaz simple, sencilla y rápida que solamente muestre los datos relevantes para quien supervisa.</p><p>La revisión de datos mas complejos si se tendría que hacer desde el computador.</p><p>La misma APP serviría para supervisar todas las subestaciones con Builder que tenga la empresa.</p><p>Es un servicio por suscripción.</p><p>La idea es quitarle protagonismo a la IHM local ya que estan perdiendo su utilidad y permitir que las subestaciones puedan ser supervisadas facilmente y no necesariamente (y unicamente) desde el centro de control.</p>','https://guardproject.com/storage/1567014481.jpg','13Axon Builder','solucion','es',NULL,'showme','empresarial','no',0,113,60,NULL,23,2,'2019-08-28 12:48:01','2019-09-17 11:02:57'),(107,'Revolución del espacio de trabajo','Se acaban los puestos de trabajo','<p>Si queremos salir de la caja literalmente tenemos que salir de nuestro propio puesto de trabajo.&nbsp;</p><p>Se acaban los puestos asignados, la oficina contará con espacios de trabajo de ocupación libre y por orden de llegada. NADIE ES DUENO DE UN PUESTO.&nbsp;</p><p>Esto unido a un programa de home office permite ademas optimizar mejor los puestos de trabajo. De manera más clara, si Axon tiene 40 empleados, NUNCA están los 40 al mismo tiempo, no es necesario tener 40 escritorios.</p><p>Cada espacio de trabajo tiene que ser igual: mismo tipo de escritorio (o mesa si son compartidas), mismo tipo de silla, con la misma cantidad de espacio, una pantalla y ojala teclados iguales (el mouse si puede ser propio).</p><p>Se contará con lockers donde cada quien podrá guardar sus cosas, solamente lo básico, de esta manera eliminamos el exceso de desorden, papelería y elementos innecesarios en los escritorios.</p><p>Se acaban los espacios u oficinas privilegiadas, todos, sin importar su rango compartirán el mismo espacio de trabajo en las mismas características, además, tanto jefes como personas de todas las áreas trabajaran juntas en el mismo espacio, de esta manera se promueve la integración inter-áreas y se elimina la distancia entre jefes y trabajadores ya que tendrán que trabajar \"hombro a hombro\". Es importante que todas las personas puedan trabajar juntas ya que se promueve un ambiente interdisciplinario, los jefes podrán interactuar y apoyar mas a los trabajadores y los trabajadores entenderán más las funciones de sus jefes.</p><p>Los espacios privilegiados (lease oficinas individuales) serán convertidas en salas de reunión, así, cuando alguien requiera reunirse con más personas de manera privada o con clientes podrán hacerlo ya que la oficina dispondrá de varias salas. Para integrar las otras ideas propuestas, puede haber zonas con diferente \"temática\", las salas de reunión podrán ser espacios no convencionales.</p><p>Todos tendrán la oportunidad de variar su espacio de trabajo cada día, eliminaremos el desorden y el uso innecesario de papel y otros elementos, los cargos que requieran uso obligatorio de papel tendrán áreas habilitadas (muebles archivadores) o espacios apropiados para esto.</p><p>Lo más importante del puesto de trabajo es usted mismo y que se pueda ubicar de manera cómoda, lo demás es un pensamiento anticuado, aprenderemos a ser más practicos.</p>','https://guardproject.com/storage/1567017504.jpg','lifeandhealth','solucion','es',NULL,'showme','empresarial','no',0,113,42,NULL,23,2,'2019-08-28 13:38:24','2019-09-17 13:55:09'),(108,'Axon builder con Comtrade integrado','Análisis de eventos de forma gráfica a partir de comtrade.','<p>La idea es que Axon Builder contenga un toolbox de Axon Comtrade. Con el principal objetivo de poder analizar eventos&nbsp; en el sistema. </p><p>En muchos casos cuando ocurre un Shut down o una falla, el ingeniero empieza a preguntarse \"como ocurrió?\" observando la secuencia de eventos registrada en el AB; sin embargo, leer una secuencia de eventos puede llegar a ser algo tediosa.</p><p>La propuesta es que con herramientas como el Comtrade se pueda mostrar el unifilar de la subestación y de forma gráfica el SCADA vaya indicando como ocurrido dicho evento de falla (Por ejemplo si fue un evento en cascada, que primero muestre la apertura del Interruptor 1, luego la apertura del Interruptor 2, etc); de esta forma se puede validar que la selectividad de protecciones sea la indicada, ademas que se podrán mostrar las gráficas de la falla presentada, como generar informes del evento.<br></p>','https://guardproject.com/storage/1567018688.gif','scienceandtechnology','solucion','es',NULL,'showme','empresarial','no',0,94,60,NULL,23,5,'2019-08-28 13:58:08','2019-09-27 10:00:20'),(109,'SCADA for renewable energy','SCADA o un toolbox para axon builder enfocado en energías renovables','<p>La ley 1715 de 2014, abrió una brecha importante en la implementación de sistemas eléctricos de energías renovables.</p><p>La idea es implimentar un SCADA o un toolbox para AB, diseñado para energías renovables, debido a que estos sistemas usualmente requieren mayores parámetros de supervisión a nivel climático y de mantenimiento para aerogeneradores, parques solares o concentradores de biomasa.&nbsp;</p><p>El SCADA no solo supervisaría todos los parámetros necesarios de un sistema renovable, sino ayudaría a deteeminar la eficiencia energética del sistema, aumentaria las estadísticas del potencial energético en diferentes zonas del país y podría ser implementado a escalas pequeñas logrando quizás mayor bases instaladas.</p>','https://guardproject.com/storage/1567049748.png','sustainability','solucion','es',NULL,'showme','empresarial','no',0,94,60,NULL,23,1,'2019-08-28 22:35:48','2019-09-17 10:55:03'),(111,'Utilizar retroalimentación inmediata en ventas','Utiliza la nueva técnica de retroalimentación inmediata','<p>asdasd</p>','https://guardproject.com/images/11.svg','sustainability','idea','es',NULL,'showme','empresarial','no',0,88,0,NULL,28,0,'2019-08-29 18:21:44','2019-08-29 18:21:44'),(112,'Técnica pomodoro para programadores','Trabajar 25 minutos y descansar obligatoriamente 5.','<p><br></p>','https://guardproject.com/images/14.svg','sustainability','idea','es',NULL,'showme','empresarial','no',0,88,0,NULL,28,0,'2019-08-29 18:22:15','2019-08-29 18:22:15'),(113,'Utilizar menos papel en la oficina','Esto ayudaría al medio ambiente.','<p><br></p>','https://guardproject.com/images/10.jpg','sustainability','idea','es',NULL,'showme','empresarial','no',0,88,0,NULL,28,0,'2019-08-29 18:22:42','2019-08-29 18:22:42'),(115,'Solucion 1 de este reto','solucion 1 de reste reto','<p>Solucion 1 de este reto<br></p>','https://guardproject.com/images/25.svg','sustainability','solucion','es',NULL,'showme','empresarial','no',0,88,114,NULL,28,0,'2019-08-29 18:49:02','2019-08-29 18:49:02'),(116,'Solucion 2 de este reto','Solucion 2 de este reto','<p>Solucion 2 de este reto<br></p>','https://guardproject.com/images/14.svg','sustainability','solucion','es',NULL,'showme','empresarial','no',0,88,114,NULL,28,0,'2019-08-29 18:49:16','2019-08-29 18:49:16'),(117,'Solucion 3 de este reto','Solucion 3 de este reto','<p>Solucion 3 de este reto<br></p>','https://guardproject.com/images/16.svg','sustainability','solucion','es',NULL,'showme','empresarial','no',0,88,114,NULL,28,0,'2019-08-29 18:49:32','2019-08-29 18:49:32'),(118,'Debemos ser más indígenas','Utilizando la técnica de analogías, hemos hecho una paralelismo entre la selva del amazonas y Axon Group. Como conclusión central debemos ser más indígenas y menos colonos incendiarios o discidentes en busca de refugio.','<p>La figura que acompaña esta propuesta ilusta la analogía utilizada entre el Amazonas y Axon Group. Identificamos las piezas claves que forman el entorno y buscamos un equivalente a la organización:</p><p>En la base se encuentra el río, este representa la cultura y el ambiente laboral, pero así mismo nuestro salario tanto monetario como emocional. Es el que debemos cuidar y proteger, porque es la fuente de vida para el resto del entorno. </p><p>Los árboles representan la infraestructura física, pero tambien nuestros líderes: son los que nos dan protección y refugio. Un árbol sano tambien da frutos (como la librerías open source) que nos apoyan para crear los productos. </p><p>Los animales son la familia, los empleados y clientes. Son fuente para que como indios podamos comer, pero si los sobre explotamos se extingen o buscan nuevos refugios.</p><p>El fuego son las amenzas: cambios en la condiciones del negocio, corrupción, accidentes. </p><p>Finalmente estan las personas: Los índigenas, quienes son repetuosos con el entorno, ayudan a cuidar la naturaleza y viven en armonía en comunidad.</p><p>¿Cómo podemos llegar a ser más indígenas?</p><p>* Creando grupos de exploradores: formando equipos que ayuden por interés propio a expandir más allá los terrenos. Buscando nuevas oportunidades y herramientas que permitan estar mejor preparados frente a las amenazas.</p><p>* El indígena no da capacitaciones, hace mentorias: no es suficiente con dar acceso al conocimiento mediante un material, es necesario sentir el acompañamiento en el proceso.</p><p>* Los estímulos que definan como reconocimiento debe ser acorde a las expectativas de cada persona. Se deben valorar y reconocer las habilidades particulares de cada miembro, apoyando su formación, dandole responsabilidad y permitiendo su crecimiento. Esto debe ser público: recomendaciones en linkedIn, cartas hacia las hojas de vida, etc.</p><p>* Se necesitan mejora arcos y flechas: mejores recursos que incrementen el salario emocional que percibimos, recompenzar los logros y estimular nuestras habilidades. ¡Capacítame!<br></p><p>* Debemos desarrollar nuestra cosmovisión: definir un manual de conducta, un código de honor, valores y reglas que permitan sentirme parte de una comunidad. No me compares sino con Facebook sino no tenemos las mismas condiciones. Motívame desde mis condiciones y dame batallas que me reten pero sean alcanzables. No juzgues mi trabajo sin conocer mi esfuerzo.</p><p>* Los indígenas tienen un gran sentido de comunidad: crea espacios de convivencia reales. Hagamos mingas para abordar problemas, integrémonos a la hora de trabajar, pueda que no sepa mucho de contabilidad, pero si me necesitan ahí estaré.</p><p>Los cambios no son costosos o técnicamente difíciles, son más de voluntad y cultura. El impacto de estos cambios estan en el ambiente laboral, incremento en la percepción de salario emocional, desempeño, fortalecimiento de la cultura organizacional, reducción del riesgo de rotación y mejora en la gestión de conocimiento.</p><p>--- R&amp;D<br></p><p> <br></p>','https://guardproject.com/storage/1567185084.jpeg','artandculture','solucion','es',NULL,'showme','empresarial','no',0,89,42,NULL,23,0,'2019-08-30 12:11:24','2019-08-30 12:11:24'),(119,'Axon Builder 2.5','SCADA para el nivel 2.5 de Automatización','<p>¿Por que la única forma de ver el sistema completo es tener que dirigirse al Centro de Control?</p><p>¿Por que no aprovechar las bondades que ofrecen las redes de comunicaciones?</p><p><span style=\"font-family: &quot;Open Sans&quot;, sans-serif;\">¿Por que no cambiar el modelo de negocio actual?</span></p><p>El AB 2.5 permite tener una visualización general del sistema de forma similar al Centro de Control, desde las consolas de operación ubicadas en nivel 2 y viceversa; podría de estar manera acceder desde el Centro de Control a cualquier Subestación y ver mas en detalles el unifilar y señales que no fueron mapeadas al Centro de Control. Esto nos permite tener una convergencia entre el Nivel 2 y el Nivel 3 de automatización (2.5).</p><p>Es así como los clientes tan solo compran una licencia de nuestro AB 2.5 con N cantidad de protocolos y N puntos (licenciamiento inicial), pero el licenciamiento será por numero de usuarios que puedan acceder al SCADA.</p><p>El desarrollo se lo dejo a R&amp;D pero pienso que podríamos enviar el SCADA a través de la red de comunicaciones empleando XML por ejemplo.</p><p>Revolucionemos la piramide de automatización y marquemos la pauta de las siguientes generaciones!!!</p>','https://guardproject.com/storage/1567188264.jpg','13Axon Builder','solucion','es',NULL,'showme','empresarial','no',0,115,60,NULL,23,2,'2019-08-30 13:04:24','2019-09-17 10:54:05'),(120,'El Efecto lugar','Vamos a crecer? Que lo básico funcione!!!','<p>Tenemos amplios espacios subutilizados, y se nota el crecimiento, sin embargo parece ser que crecemos como las ciudades: \"sin planeación y en la medida que nos impongan\", hay gente que debería tener un espacio agradable para trabajar y nos toca \"sacarlos a recepción\" por que hay un piso desnivelado que así permanecerá. Somos ingenieros y pretendemos vender la idea de hacer buenos tableros: \"organizados y que damos buen trato a los IEDs\" y \"arrumamos\" equipos electrónicos unos encima de otros que algún día tendrán un buen espacio.&nbsp;</p><p>Somos electricistas y hay interruptores que no sirven o sirven a medias, que para efectos de la ingeniería que vendemos es lo mismo.&nbsp;</p><p>Nos afana desplazarnos a un proyecto y no tener la mejor información para trabajar, pero no hay información actualizada de las instalaciones.&nbsp;</p><p>Queremos que la gente entienda que nuestros productos tienen valor, que asista a cursos y este dispuesto a pagar por ellos, pero promovemos que nuestra gente busque el conocimiento gratuito que emerge de las redes. </p><p>Esperamos difundir la marca pero filtramos con recelo quien debe ir a un evento, y en muchos casos no hay el espacio para promover esa participación.&nbsp;</p><p>El lugar para fomentar genios es \"<span style=\"color: rgb(97, 97, 97); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 18px;\">Son entornos que “permiten alimentar la creatividad, pero también estar abiertos a experimentar y plantear nuevas ideas”,... El autor concluye que los genios, más que estrellas fugaces, son flores que germinan en medio de un entorno favorable.</span><span style=\"font-family: &quot;Open Sans&quot;, sans-serif;\">\"</span></p><p>La manera de pensar de alguien, depende del entorno en el que se encuentra.&nbsp;</p><p><span style=\"font-family: &quot;Open Sans&quot;, sans-serif;\"><br></span></p><p><span style=\"font-family: &quot;Open Sans&quot;, sans-serif;\"><br></span></p>','https://guardproject.com/storage/1567260736.jpeg','businessandconsumer','solucion','es',NULL,'showme','empresarial','no',0,93,42,NULL,23,1,'2019-08-31 09:12:16','2019-09-17 11:27:43'),(122,'Recipientos hechos de hoja de plátano','Esto para ir implementando el uso de material natural en vez de plástico','<p>Promover el uso en muchas cosas de alimentos, además de que quedan sabiendo mucho mejor, por ejemplo, un fiambre.</p><p><br></p>','https://guardproject.com/storage/1567478041.jpg','sustainability','idea','es',NULL,'showme','public','no',0,125,0,NULL,23,1,'2019-09-02 21:34:01','2019-09-13 14:28:25');
INSERT INTO `innovations` VALUES (124,'AXON BUILDER INDUSTRIA','Adicionar librerías para utilizar en Industria y Multitouch','<p style=\"font-family: &quot;Open Sans&quot;, sans-serif;\">Ahora, cualquier proceso de la parte industrial por pequeño que sea se hace automatizado, y en energía las subestaciones son desatendidas ya no se instala en todas las automatizaciones.</p><p style=\"font-family: &quot;Open Sans&quot;, sans-serif;\">Axon Builder 3.0 es un Scada prometedor, por lo que el trabajo duro ya esta hecho.</p><p style=\"font-family: &quot;Open Sans&quot;, sans-serif;\"><br></p><p style=\"font-family: &quot;Open Sans&quot;, sans-serif;\">De acuerdo a lo anterior la idea es adicionar librerías para la parte industrial, y para entrar al mercado dejar por ejemplo licencias gratis hasta 50 tags.</p><p style=\"font-family: &quot;Open Sans&quot;, sans-serif;\">Y adicionar la característica de multitouch, esto es que sea como una aplicación de un celular, donde se puede darle zoom, pasar mímicos al deslizar, etc</p><p style=\"font-family: &quot;Open Sans&quot;, sans-serif;\">Espero comentarios</p>','data:image/png;base64,','13Axon Builder','solucion','es',NULL,'showme','empresarial','no',0,76,60,NULL,23,4,'2019-09-04 16:59:22','2019-09-17 18:16:29'),(125,'Integración SCADA / IDS','Desarrollo de un IDS que permita identificar anomalías de seguridad en la red operativa de la subestación y el reporte en el SCADA','<p>Desarrollo de un IDS que permita identificar anomalías de seguridad en la red operativa de la subestación. Los incidentes de seguridad deben reportarse en el SCADA como alarmar, donde el operador puede tomar una acción ante la eventualidad.</p><p>El IDS debe monitorear el tráfico, secuencias de tramas, GOOSE y en caso de que detecte una anomalía debe reportarla al SCADA con lo cual se puede dar trazabilidad a los eventos</p>','https://guardproject.com/storage/1567637260.jpg','sustainability','solucion','es',NULL,'showme','empresarial','no',0,129,60,NULL,23,5,'2019-09-04 17:47:40','2019-09-17 11:37:08'),(126,'SCADA PREDICTIVO','Módulo de SCADA con algoritmos para predecir fallas.','<p>En el mercado existe un software <span style=\"background-color: rgb(255, 255, 0);\"><b>(valor: 300.000 usd) </b></span>para los transformadores&nbsp; de <b style=\"background-color: rgb(255, 255, 0);\">200MVA</b> de potencia, el cual esta monitoriando el transformador, tiene algoritmos que le anticipan fallas y le informan a la empresa cuando hacer mantenimiento (una falla de un trafo de 200 mva podría dejar sin energía a un país).&nbsp; Ejemplos:</p><p><span style=\"font-family: Verdana; font-size: 13.3333px; text-align: justify;\">&nbsp;Pronóstico de Carga y Temperatura para un día específico de la semana; también se puede realizar para varios días o semanas.</span><br></p><p><span style=\"font-family: Verdana; font-size: 13.3333px; text-align: justify;\">Este análisis trae como ventaja poder pronosticar la temperatura de funcionamiento promedio, la temperatura máxima del punto caliente del transformador y<b style=\"background-color: rgb(255, 255, 0);\"> la hora aproximada a la que ocurrirían estos eventos</b>.</span><span style=\"font-family: Verdana; font-size: 13.3333px; text-align: justify;\"><br></span></p><p><span style=\"font-family: Verdana; font-size: 13.3333px; text-align: justify;\"><br></span><span style=\"font-family: Verdana; font-size: 13.3333px; text-align: justify;\">Es el Software que recoge las tablas básicas para el control de las variables y parámetros para el diagnóstico del estado, los resultados de las pruebas off-line, online y tiempo real. Recoge sus resultados los analiza e interactúa dinámicamente con ellos. Además recaba los datos de falla, efectúa procesamiento estadístico y da seguimiento al punto de diagnóstico, que va variando con el envejecimiento del aislamiento del equipo en general y facilita los datos almacenados al Sistema Experto de Gases.</span><br></p><p><span style=\"font-family: &quot;Open Sans&quot;, sans-serif;\">La propuesta es: <b><span style=\"background-color: rgb(255, 255, 0);\">Enfocarse en un Scada que tenga un módulo para predecir fallas</span> </b>de los equipos asociados al sistema de control de una subestación. Incluir los algoritmos del software para los trasnformadores tanto de 200mva como mas pequeños, pero también explorar el diagnostico y predicción para otros equipos, como interruptores, cts, pts, seccionadores.</span><br></p><p>Ver la posibilidad de conocer información del coordinador (Colombia \"XM\") para que el modulo del SCADA advierta al operador de una posible maniobra a realizar en los próximos minutos.</p><p>Unir la idea de Oscar Pulido y revisar los comtrade para predecir fallas, ejemplo ir a revisar el interruptor porque esta próximo a fallarle la bobina, mas lo descrito por Oscar Pulido.</p><p>Tomar información de los concentradores o datos que se tienen el Scada, para monitorear variables con frecuentes fallas, como calidad invalida, retardos u otros, para que el advierta al operador que valla a revisar.</p><p>Tomar características de diagnostico de redes, para advertir fallas de suiches entre otros.</p><p><b style=\"background-color: rgb(255, 255, 0);\">El objetivo es que este enfocado a predecir, darse la tarea de investigar como poder predecir y en que tanto se podría predecir.</b></p><p><br></p><p><span style=\"background-color: rgb(255, 255, 0);\"><b>Una idea de una solución que otros Scadas no tengan. Para no desarrollar lo que ya existe&nbsp;</b></span></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p>','https://guardproject.com/storage/1567721660.jpg','scienceandtechnology','solucion','es',NULL,'showme','empresarial','no',0,112,60,NULL,23,4,'2019-09-05 17:14:20','2019-09-27 09:57:57'),(127,'Axontransfer P2P','Una web para transferencia de archivos P2P','<p>wetransfer es una de las webs mas utilizadas a nivel mundial, ranking 154.</p><p>La idea es hacer una web de transferencia de archivos pero en P2P, es decir como un bitorrent, la ventaja es que seria mas rápido, y ademas mientras esta subiendo el otro empieza a descargar, y no se corta la descarga.</p><p>Axon Group para el envio de archivos, utilizamos wetransfer, el problema es que si quien va a descargar tiene el internet lento, la descarga se cae y es necesario reiniciarla.</p><p>Entonces con AxonTransfer, se igual a wetransfer, pero la diferencia es que vamos a utiliza la tecnología que utilizan los Torrent, pero los servidores de torrent, serian servidores privados de Axon Group</p><p><br></p>','data:image/jpeg;base64,','19Aplicacion WEB','idea','es',NULL,'showme','empresarial','no',0,76,0,NULL,23,10,'2019-09-05 20:19:52','2019-10-01 10:00:04'),(128,'probando fech','probandoo fecha','<p>asdasd</p>','https://guardproject.com/images/10.jpg','1sustainability','reto','es',NULL,'showme','me','undefined',0,125,0,'01/10/2019',23,6,'2019-09-06 00:39:58','2019-09-20 11:41:49'),(129,'Rele de protección y control','Rele de proteccion y control como una Tablet','<p>Con la llegada de las subestaciones digitales, los I/O (entradas salidas) están remotos con Mergin Unit, esto quiere decir que el rele ya no necesita entradas y salidas, solo procesar y mostrar datos.</p><p>La idea es hacer un rele sin entradas/salidas, y recibir los datos desde las Mergin Unit, y mostrar mas datos como Comtrade diractamente.</p><p>Para esto sería un equipo con doble procesador uno para proteccion en tiempo real, y otro para despliegues.</p><p><br></p><p>Comentarios...</p><p><br></p>','https://guardproject.com/storage/1567811763.PNG','20Otros','idea','es',NULL,'showme','empresarial','no',0,76,0,NULL,23,5,'2019-09-06 18:16:03','2019-09-17 11:43:27'),(130,'Implementar la técnica de aprendizaje PIMSLEUR para el idioma Inglés','Esta ténica consiste en implementar un inglés solo hablado','<p>A diferencia de otros cursos o técnicas, este método se concentra en hacer que aprendamos como niños, escuchando y repitiendo.</p><p>Es simple pero tiene grandes ventajas de las cuales puedo dar fé de ello:</p><p>Ventajas:</p><p>&nbsp;- Aprendizaje ultrarápido de un inglés hablado.</p><p>&nbsp;- Pronunciación correcta del inglés.</p><p>- Fluidez natural al cabo de unos meses de haber comenzado el curso.</p><p>Sin ser más, para aquella persona interesada aquí dejo del link del curso.</p><p>Nota: el curso tiene una duración de 3 meses, 30 audios/mes.&nbsp;</p><p>Duración de audios: ~20 mins</p><p><br></p><p><a href=\"https://drive.google.com/drive/folders/1oHa0OxDaBSVo5obUT9KZpYy4YKBKqoF2?usp=sharing\" target=\"_blank\">Link drive curso PIMSLEUR</a></p><p><br></p><p>&nbsp; Muchas gracias.<br><br></p>','https://guardproject.com/storage/1567869119.png','20Otros','idea','es',NULL,'showme','public','no',0,125,0,NULL,23,1,'2019-09-07 10:11:59','2019-09-13 12:07:14'),(131,'Piñones de bicicleta contra robo','Mecanismo para desactivar los piñones por medio de un control','<p>Disminuir el robo de bicicletas, que normalmente se las llevan utilizándola para escapar en la misma bicicleta.</p><p>La idea es por medio de un control remoto, que si se aleja de la bicicleta, esta suelta el piñon por lo que no funcionaria dar pedal, o la otra opcion es mecanismo de bloqueo de la llanta (freno), pero la idea es que el ladrón no pueda andar en la bicicleta, por lo que la opción que le quedaría seria abandonarla.</p>','data:image/jpeg;base64,','8transport','idea','es',NULL,'anonymous','public','no',0,76,0,NULL,23,2,'2019-09-08 21:13:00','2019-09-30 15:17:55'),(132,'Todos en capacidad de responder ¿Que hace Axon Group?','Idea del Tablero: Lenguaje Técnico','<p>En el tablero de Innovaxion se suguirio Minicharlas de aprendizaje sobre lenguaje técnico de las diferentes areas.&nbsp;</p><p>A esta idea se sumo: Lo ideal sería hacerlo de manera más didactica, Ejm. Juego tipo parques, tio rico, uno, etc. Se tendría que pensar bien los juegos. Elegir un día para hacer la \"reunión\". Además esto fortalece la cultura organizacional de la empresa.&nbsp;</p>','https://guardproject.com/storage/1568048062.jpg','sustainability','solucion','es',NULL,'anonymous','empresarial','no',0,93,42,NULL,23,4,'2019-09-09 11:54:22','2019-09-13 07:58:39'),(133,'¿A qué será que se refiere el cliente con Protocolos? ¿Eso lo enseñamos?','Si me incluyen yo puede responder con propiedad!!!','<p>IDEA de Tablero InnovAXiON: Formalizar en protocolos de comunicación que nos permitan ser más asertivos en nuestra comunicación.&nbsp;</p>','https://guardproject.com/storage/1568048910.jpg','sustainability','solucion','es',NULL,'anonymous','empresarial','no',0,93,42,NULL,23,3,'2019-09-09 12:08:30','2019-09-26 09:01:32'),(134,'Espacios para compartir Ideas con Cafe','utilizar el \"momento del  pan\" como escenario para la creatividad','<p><b>Idea del Tablero de InnvAXiON.&nbsp;</b></p><p><span style=\"font-family: &quot;Open Sans&quot;, sans-serif;\">Promover la Ideación a la Hora del Cafe!!!</span><br></p>','https://guardproject.com/storage/1568067459.jpg','sustainability','solucion','es',NULL,'anonymous','empresarial','no',0,93,42,NULL,23,1,'2019-09-09 17:17:39','2019-09-11 14:13:04'),(135,'Estar por las Nubes','Gestión Documental por Suscripción','<p><b>Ideal del Tablero de InnovAXiON</b></p><p>Idea de Servicio por suscripción: Servicio de gestión de documentos para clientes por medio del BMS. El cliente paga suscripción y Axon gestiona el almacenamiento de la información.&nbsp;</p><p><b><br></b></p>','https://guardproject.com/storage/1568068000.jpg','sustainability','solucion','es',NULL,'anonymous','empresarial','no',0,93,60,NULL,23,11,'2019-09-09 17:26:40','2019-09-24 20:27:55'),(137,'Llego la hora de la Pausa','App para pausa activa','<p>Idea del tablero de InnovAXiON</p><p><span style=\"font-family: &quot;Open Sans&quot;, sans-serif;\">Buscar y utilizar aplicaciones para notificar al personal realizar las pausas activas.&nbsp;</span><br></p>','https://guardproject.com/storage/1568068155.jpg','17Cultura organizacion','idea','es',NULL,'anonymous','empresarial','no',0,93,0,NULL,23,3,'2019-09-09 17:29:15','2019-09-24 20:27:36'),(138,'Gestion de Actas','Menos Papel para el registro de actas','<p style=\"font-family: &quot;Open Sans&quot;, sans-serif;\"><span style=\"font-weight: bolder;\">Idea del Tablero de InnovAXiON</span></p><p style=\"font-family: &quot;Open Sans&quot;, sans-serif;\">Sistema de gestión de actas de reuniones. La asistencia se firma virtualmente. Puede integrar más funcionalidades para gestionar documentación del SIG de manera practica. Muchas empresas lo comparian.&nbsp;</p>','https://guardproject.com/storage/1568068838.jpg','1sustainability','idea','es',NULL,'showme','empresarial','no',0,93,0,NULL,23,1,'2019-09-09 17:40:38','2019-09-11 14:14:53'),(140,'Gestion del tiempo y H. Blandas','Herramientas para mejorar gestión','<p><span style=\"font-family: &quot;Open Sans&quot;, sans-serif;\">Curso de Time Management que permita desarrollar habilidades blandas mientras se fomenta una mayor eficiencia.&nbsp;</span><br></p>','data:image/jpeg;base64,','17Cultura organizacion','solucion','es',NULL,'anonymous','empresarial','no',0,93,42,NULL,23,8,'2019-09-09 18:32:22','2019-10-01 10:01:44'),(141,'Sala de Lectura','Espacio que fomenten la Lectura','<p><b>Idea del Tablero de InnovAXiON</b></p><p>Retormar el programa de lectura incluyendo material de Innovación y Emprendimiento. Sala de Lectura</p><p><b><br></b></p>','https://guardproject.com/storage/1568072339.jpg','1sustainability','idea','es',NULL,'anonymous','empresarial','no',0,93,0,NULL,23,16,'2019-09-09 18:38:59','2019-10-01 10:01:18'),(142,'para probar comentarios','asdasd','<p>asdasd</p>','https://guardproject.com/images/3.svg','1sustainability','idea','es',NULL,'showme','me','no',0,125,0,NULL,23,1,'2019-09-13 18:15:35','2019-09-13 18:15:42'),(143,'Gateway con SDN','Incorporar la funcionalidad de SDN en el AE','<p>La finalidad es&nbsp;<span style=\"font-family: &quot;Open Sans&quot;, sans-serif;\">simplificar el proceso de configuración y administración de redes de datos en entornos industriales. Las&nbsp;</span><span style=\"font-family: &quot;Open Sans&quot;, sans-serif;\">características principales serían:</span></p><p>- Auto-configuración y manejo de redundancias (RSTP).</p><p><span style=\"font-family: &quot;Open Sans&quot;, sans-serif;\">- Configuración automática y/o manual de Slices (VLAN).</span></p><p><span style=\"font-family: &quot;Open Sans&quot;, sans-serif;\">- Módulo de&nbsp;</span><font face=\"Open Sans, sans-serif\">estadísticas.</font></p><p>- Descubrimiento automático de la red.</p><p>- Análisis de paquetes.</p>','https://guardproject.com/storage/1568994619.PNG','14Axon Exchange','solucion','es',NULL,'showme','empresarial','no',0,115,60,NULL,23,14,'2019-09-20 10:50:19','2019-09-26 18:09:26'),(144,'Orinal hombre piso 2','Intalar un orinal para los hombre en el piso 3','<p>En uno de los dos espacios que hay duchas sin utilizar en el piso 3, instalar un orinal para hombres para el ahorro de agua.</p><p><br></p>','https://guardproject.com/storage/1568995020.jpg','17Cultura organizacion','idea','es',NULL,'showme','empresarial','no',0,76,0,NULL,23,19,'2019-09-20 10:57:00','2019-10-01 11:47:11'),(145,'nueva idea de borrador','asdasd','<p>asdasd</p>','https://guardproject.com/images/11.svg','1sustainability','idea','es',NULL,'showme','me','no',0,125,0,NULL,23,0,'2019-09-20 11:36:19','2019-09-20 11:36:19'),(146,'+20','sdasd','<p>sdasd</p>','https://guardproject.com/images/11.svg','1sustainability','idea','es',NULL,'showme','me','no',0,125,0,NULL,23,0,'2019-09-20 11:39:17','2019-09-20 11:39:17'),(148,'Pruebas automáticas IEC 61850','Agregar a AT61 la funcionalidad de realizar pruebas automáticas de 61850','<p>Implementar una herramienta para probar IEDs, o Gateways o Scadas, de acuerdo con la norma IEC 61850 ED1 o ED2, que le de un reporte de que cumple y de que no cumple de acuerdo a la norma.</p><p>Un ejemplo aplicado a nuestro caso es que se reduce el tiempo en pruebas, por ejemplo para probar el AE o AB, en IEC 61850, seria rápido y reduce el tiempo de intervención de un TESTER humano</p><p>Para una segunda version, se podría hacer pruebas de seguridad en una subestación, y revisar las configuraciones MMS y GOOSE de una subesatcion</p>','https://guardproject.com/storage/1569504397.jpg','21AT61','idea','es',NULL,'showme','empresarial','no',0,76,0,NULL,23,16,'2019-09-26 08:26:37','2019-10-01 14:47:07');
