CREATE TABLE `tasks` (
  `id` int(100) unsigned NOT NULL AUTO_INCREMENT,
  `des` varchar(1500) COLLATE utf8mb4_unicode_ci DEFAULT '...',
  `text` varchar(1500) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
