  `history` int(11) NOT NULL DEFAULT '0',
  `color` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `modify` varchar(123) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
